INSERT INTO products (id, name, price, rating, description, category_id) VALUES
  ('00000000-0000-7000-0000-000278469304', 'Điện thoại Masstel Izi 56 4G (LTE) Gọi HD Call ,Pin khủng ,loa lớn - Hàng Chính Hãng', 499000, 0, '<article class="4ever-article"><p>Thắng thao mobile cam kết</p><p> </p><p>Hàng chính hãng mới 100%</p><p>Bảo hành 12 tháng</p><p> </p><p>Cấu hình sản phẩm :</p><ul><li><div>Màu Sắc Black, Blue, Gold</div></li><li><div>Dung Lượng Pin 2500mAh</div></li><li><div>Hỗ trợ sim: 2 Sim 2 Sóng</div></li><li><div>Màn Hình: 2.4" QVGA</div></li></ul><ul><li><div>FM không dây, chữ to rõ ràng</div></li><li><div>Đèn pin chiếu sáng mạnh/ Phím Bật/Tắt đèn nhanh</div></li><li><div>Danh bạ người thân tiện dụng</div></li><li><div>Bổ sung tính năng xem lịch ÂM tiện lợi</div></li></ul><p> </p><h3>Masstel trình làng Masstel IZI 56 mẫu điện thoại phổ thông hỗ trợ 4G VoLTE thuộc series IZI, sở hữu thiết kế thân thiện, chip xử lý Unisoc, thời lượng pin ấn tượng và nhiều tính năng tiện ích.</h3><h3>Thiết kế truyền thống, dễ thao tác</h3><p>Masstel IZI 56 chế tác theo đúng chuẩn thiết kế “cục gạch” mà bạn vẫn quen thuộc với mặt trước gồm 2 phần, phần trên là màn hình và phần dưới là bàn phím vật lý với các nút nhấn lớn được ký hiệu chi tiết cho người dùng bấm chính xác. Màn hình có kích thước 2.4 inch, độ phân giải QVGA (240 x 320 Pixels), 262.000 màu hiển thị chữ viết to rõ, đầy đủ nội dung, nhìn thoải mái và dễ thao tác.</p><p><img src="https://salt.tikicdn.com/cache/w750/ts/product/7e/fa/d0/73f59cedde2a6b767854a798b60f0fdb.jpg" alt="7efad0c4dd945480c29bf972724cd93e.jpg" /> </p><p>Ở cạnh trên điện thoại có quả đèn pin cho độ sáng cao, buổi tối khi cần tìm đồ vật bạn có thể trực tiếp mở đèn pin này mà không cần bật đèn bàn, đèn phòng.</p><p> </p><p>Chất liệu sử dụng rất đáng tin cậy, với khung viền kim loại cứng cáp, vỏ máy bằng nhựa PC và ABS cho khả năng chống chịu lực tốt, an toàn ngay cả trong môi trường thay đổi nhiệt độ.</p><p>Mặc dù được Masstel nhấn mạnh là điện thoại dành cho người lớn tuổi nhưng em ấy cũng rất xứng đôi với các bạn trẻ nhờ kiểu dáng hiện đại, nhỏ xinh và màu sắc thì cực yêu, ngoài màu đen lịch lãm, Masstel IZI 56 còn có màu vàng tươi tắn, thời trang, cho bạn chọn tùy thích.</p><p> </p><h3>Nâng cao chất lượng cuộc gọi nhờ công nghệ 4G VoLTE hiện đại</h3><p>Điện thoại này được Masstel chuyển đổi từ công nghệ GSM sang 4G VoLTE tín hiệu không dây chất lượng tốt, hạn chế được tình trạng mất tín hiệu trong quá trình sử dụng, mang đến âm thanh trung thực cho mọi cuộc gọi đồng thời giúp tiết kiệm pin tối đa.</p><p> </p><p>Masstel Izi 56 còn được bổ sung tính năng đặc biệt và rất hữu ích – Xem lịch Âm tiện dụng rất tiện lợi dành cho khách hàng.</p><p> </p><p>Ngoài ra, sản phẩm có hỗ trợ tính năng Radio FM không cần kết nối tai nghe mà vẫn đảm bảo chất lượng thu sóng tốt, giúp sử dụng nghe radio tiện lợi hơn.</p><p><img src="https://salt.tikicdn.com/cache/w750/ts/product/b8/46/23/16eee3556fb720fa144f7fea87a592c1.jpg" alt="b84623115856f634a7510c3952e457d1.jpg" /> </p><h3>Xử lý nhanh chóng, không phải chờ đợi</h3><p>Bộ xử lý nhanh chóng, bộ nhớ trong phù hợp đáp ứng các tác vụ cơ bản thường nhật của một chiếc điện thoại phổ thông một cách hiệu quả, ổn định. Điện thoại hỗ trợ 2 Nano SIM danh bạ lưu đến 500 số, có thể dùng thêm thẻ nhớ MicroSD, hỗ trợ tối đa 16 GB cho bạn lưu trữ được nhiều hình ảnh, tin nhắn và các dữ liệu khác dễ dàng.</p><h3><img src="https://salt.tikicdn.com/cache/w750/ts/product/2c/cb/1f/c70c2ee62c2d3ef6d4a4f3d1a7de2021.jpg" alt="2ccb1feca0aa48d24b930bfa2d71acf1.jpg" /> </h3><p> </p><p> </p><p>#thangthaomobile #dienthoaimasstel #masstelizi56</p><p> </p><p> </p></article><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000001796'),
