  ('00000000-0000-7000-0000-000278500816', 'Điện Thoại Oppo A3x 6GB/128GB - Hàng Chính Hãng', 3779000, 0, '<p>Điện Thoại Oppo A3x 6GB/128GB - Hàng Chính Hãng</p><p>Bộ sản phẩm bao gồm: Thân máy, sạc, cáp USB, dụng cụ lấy sim, vỏ bảo vệ, sách hướng dẫn.</p><p><img src="" width="2039" height="1139" alt="vn-11134208-7ras8-mchic29oqq8sf3" /></p><p>Màn hình siêu sáng, siêu mượt mà</p><p>- Sở hữu màn hình 6.67inch trên tấm nền IPS LCD với tần số quét 90 Hz, mang lại trải nghiệm hình ảnh mượt mà và sống động. Màn hình có độ sáng lên đến 1000nits, đảm bảo mọi nội dung hiển thị luôn sắc nét và dễ dàng đọc khi bạn di chuyển ngoài trời hoặc ở những nơi có ánh sáng gắt.</p><p>Camera chụp ảnh cơ bản.</p><p>- Trang bị camera sau có độ phân giải 8MP, chụp ảnh rõ nét và sống động trong mọi điều kiện ánh sáng. Cùng với đó là cảm biến flicker giảm nhiễu và nhòe, đảm bảo chất lượng ảnh tốt hơn ngay cả khi ánh sáng không ổn định.</p><p>- Camera trước 5MP được hỗ trợ bởi công nghệ làm đẹp, cho phép tùy chỉnh các cấp độ làm đẹp theo ý muốn của người dùng.</p><p> </p><p>Hiệu năng mượt mà</p><p>- Trang bị sức mạnh từ vi xử lý Snapdragon 6s Gen 1 thế hệ mới cung cấp hiệu năng mạnh mẽ, mà còn giúp máy hoạt động mượt mà trong mọi tác vụ hằng ngày, từ lướt web, xem video cho đến chơi game.</p><p>- Máy được trang ram bị 6GB bạn có thể dễ dàng chạy nhiều ứng dụng cùng lúc mà không gặp hiện tượng giật lag.</p><p>- Bộ nhớ trong của máy 128GB, đủ rộng rãi để bạn lưu trữ nhiều hình ảnh, video và dữ liệu cá nhân. Hơn nữa, bạn có thể mở rộng dung lượng lưu trữ lên tới 1TB thông qua thẻ MicroSD, giúp việc lưu trữ trở nên linh hoạt hơn bao giờ hết.</p><p> </p><p>Pin khủng, sạc nhanh chóng và an toàn</p><p>- Với viên pin 5100mAh cho thời lượng sử dụng kéo dài, cho phép bạn thoải mái dùng điện thoại suốt ngày dài. Điểm sáng là công nghệ SUPERVOOC 45W, giúp sạc nhanh 50% chỉ trong 30 phút, theo hãng công bố.</p><p>Điện Thoại Oppo A3x 6GB/128GB - Hàng Chính Hãng</p><p> </p><p>Cảm ơn quý khách đã quan tâm đến sản phẩm bên shop, quý khách vui lòng dành ít thời gian đọc kĩ chính sách bảo hành đổi trả:</p><p>- Sản phẩm được bao test 7 ngày kể từ ngày nhận được sản phẩm và sẽ được đổi máy mới cùng model hoặc giá trị tương đương sau khi được thẩm định lỗi kĩ thuật.</p><p>- Sản phẩm lỗi kĩ thuật được xác nhận bởi trung tâm bảo hành ủy quyền chính hãng (bằng văn bản); khách hàng có thể gửi lại shop để xác nhận lỗi hoặc tới trạm bảo hành gần nhất để thẩm định lỗi.</p><p>- Sản phẩm đổi trả phải còn nguyên hiện trạng máy không trầy xước, không bể vỡ, vô nước, gãy chân sim, khung thẻ nhớ… (tất cả các tác động ngoại lực từ phía khách hàng đều TỪ CHỐI BẢO HÀNH)</p><p>- Sản phẩm đổi trả phải còn nguyên hộp trùng imei, phụ kiện kèm theo máy không trầy xước, cháy nổ, đứt dây (nếu trầy xước shop không đổi phụ kiện mới)</p><p>- Sau 7 ngày bao test, sản phẩm vẫn nhận chính sách bảo hành 12 tháng kể từ ngày kích hoạt bảo hành (khách chịu phí vận chuyển tới shop bảo hành hộ hoặc tự đến trung tâm bảo hành gần nhất để được hỗ trợ)</p><p>- Trong một số trường hợp sản phẩm đã được kích hoạt bảo hành điện tử để tham gia chương trình khuyến mãi có giá tốt cho khách hàng. Vui lòng chat với nhân viên tư vấn để được hỗ trợ thêm thông tin.</p><p>- Sản phẩm bị TỪ CHỐI BẢO HÀNH khi cháy nổ, bể vỡ, tác động ngoại lực vào thân và bên trong máy, có thay đổi sửa chữa bên ngoài.</p><p>- Các sản phẩm bị khóa tài khoản như Gmail, Samsung account…Khách tự chịu phí mở khóa nếu không nhớ mật khẩu.</p><p>Điện Thoại Oppo A3x 6GB/128GB - Hàng Chính Hãng</p><p> </p><p>#honghanhmobile #honghanhmobilemall #hhm #dienthoaichinhhanghonghanh #oppo_a3x #a3x #điện_thoại #dienthoai #di_động #didong #điện_thoại_di_động #dien_thoai_di_dong #điện_thoại_chính_hãng #hàng_chính_hãng #điện_thoại_giá_rẻ #dien_thoai_gia_re #giá_rẻ #khuyen_mai #freeship #mobile #smartphone #điện_thoại_oppo #oppo</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000001795'),
  ('00000000-0000-7000-0000-000278500947', 'Điện Thoại Realme C71 4GB/128GB - Hàng Chính Hãng', 3039000, 0, '<p>Điện Thoại Realme C71 4GB/128GB - Hàng Chính Hãng</p><p>Bộ sản phẩm bao gồm: Thân máy, sạc, cáp USB, dụng cụ lấy sim, vỏ bảo vệ, sách hướng dẫn sử dụng.</p><p><img src="" width="2040" height="1140" alt="vn-11134208-7ras8-md1nwvn93rksb6" /></p><p>Màn hình lớn, mượt mà, trải nghiệm thị giác cực đã</p><p>- Trang bị màn hình rộng 6.67 inch, sử dụng công nghệ TFT LCD và độ phân giải HD+ (720 x 1604 pixels), mang đến hình ảnh rõ nét, chi tiết cho việc xem phim, chơi game và lướt mạng xã hội. Tần số quét 120 Hz giúp các thao tác cuộn trang, chuyển cảnh trở nên mượt mà và phản hồi nhanh chóng.</p><p>- Bên cạnh đó, độ sáng 725nits giúp màn hình hiển thị rõ nét dưới ánh sáng mạnh, trong khi kính cường lực Panda bảo vệ tốt. Dù dùng tấm nền TFT LCD tiết kiệm, realme C71 vẫn cân bằng với tần số quét cao và độ sáng ấn tượng, mang lại hình ảnh sống động, phù hợp cho giải trí và công việc hàng ngày.</p><p> </p><p>Ảnh rõ nét, video mượt mà, bắt trọn cảm xúc</p><p>- Trang bị camera chính 50MP cùng cảm biến Flicker, giúp chụp ảnh rõ nét, chi tiết trong nhiều điều kiện ánh sáng. Camera hỗ trợ quay video HD 720p và Full HD 1080p ở 30fps. Đèn flash tích hợp hỗ trợ chụp thiếu sáng, mang đến trải nghiệm nhiếp ảnh linh hoạt, phù hợp cả nhu cầu chụp ảnh thường ngày lẫn quay video cơ bản.</p><p>- Đối với ảnh selfie, camera trước 5MP là lựa chọn lý tưởng cho những bức ảnh tự sướng chất lượng cao và cuộc gọi video rõ nét, có thể đi kèm với các tính năng như xóa phông và Làm đẹp để nâng cao chất lượng ảnh tự chụp.</p><p> </p><p>Hiệu năng ổn định cho tác vụ hằng ngày</p><p>- Trang bị chip Unisoc T7250 tám nhân (1.8 GHz), mang lại hiệu năng ổn định cho các tác vụ thường ngày. Máy khởi chạy ứng dụng nhanh, đa nhiệm mượt và xử lý tốt các game phổ biến.</p><p>- Realme C71 có Ram 4GB cho phép chuyển đổi ứng dụng mượt mà, đáp ứng tốt nhu cầu sử dụng hàng ngày. Bộ nhớ trong 128GB (khả dụng khoảng 105GB) cung cấp không gian lưu trữ rộng rãi.</p><p> </p><p>Năng lượng bền bỉ &amp; sạc nhanh, luôn kết nối dài lâ</p><p>- Sở hữu viên pin lớn 6300mAh, cho thời gian sử dụng cả ngày dài dù chơi game hay xem video liên tục. Dung lượng pin ấn tượng này giúp người dùng yên tâm sử dụng với cường độ cao.</p><p>- Realme C71 hỗ trợ sạc nhanh SuperVOOC 45W, giúp nạp pin nhanh chóng, tiết kiệm thời gian chờ. Chỉ vài phút sạc là đủ dùng trong nhiều giờ, phù hợp với người bận rộn.</p><p>Điện Thoại Realme C71 4GB/128GB - Hàng Chính Hãng</p><p> </p><p>Cảm ơn quý khách đã quan tâm đến sản phẩm bên shop, quý khách vui lòng dành ít thời gian đọc kĩ chính sách bảo hành đổi trả:</p><p>- Sản phẩm được bao test 7 ngày kể từ ngày nhận được sản phẩm và sẽ được đổi máy mới cùng model hoặc giá trị tương đương sau khi được thẩm định lỗi kĩ thuật.</p><p>- Sản phẩm lỗi kĩ thuật được xác nhận bởi trung tâm bảo hành ủy quyền chính hãng (bằng văn bản); khách hàng có thể gửi lại shop để xác nhận lỗi hoặc tới trạm bảo hành gần nhất để thẩm định lỗi.</p><p>- Sản phẩm đổi trả phải còn nguyên hiện trạng máy không trầy xước, không bể vỡ, vô nước, gãy chân sim, khung thẻ nhớ… (tất cả các tác động ngoại lực từ phía khách hàng đều TỪ CHỐI BẢO HÀNH)</p><p>- Sản phẩm đổi trả phải còn nguyên hộp trùng imei, phụ kiện kèm theo máy không trầy xước, cháy nổ, đứt dây (nếu trầy xước shop không đổi phụ kiện mới)</p><p>- Sau 7 ngày bao test, sản phẩm vẫn nhận chính sách bảo hành 12 tháng kể từ ngày kích hoạt bảo hành (khách chịu phí vận chuyển tới shop bảo hành hộ hoặc tự đến trung tâm bảo hành gần nhất để được hỗ trợ)</p><p>- Trong một số trường hợp sản phẩm đã được kích hoạt bảo hành điện tử để tham gia chương trình khuyến mãi có giá tốt cho khách hàng. Vui lòng chat với nhân viên tư vấn để được hỗ trợ thêm thông tin.</p><p>- Sản phẩm bị TỪ CHỐI BẢO HÀNH khi cháy nổ, bể vỡ, tác động ngoại lực vào thân và bên trong máy, có thay đổi sửa chữa bên ngoài.</p><p>- Các sản phẩm bị khóa tài khoản như Gmail, Samsung account…Khách tự chịu phí mở khóa nếu không nhớ mật khẩu.</p><p>Điện Thoại Realme C71 4GB/128GB - Hàng Chính Hãng</p><p> </p><p>#honghanhmobile #honghanhmobilemall #hhm #dienthoaichinhhanghonghanh #realme_c71 # c71 #điện_thoại #dienthoai #di_động #didong #điện_thoại_di_động #dien_thoai_di_dong #điện_thoại_chính_hãng #hàng_chính_hãng #điện_thoại_giá_rẻ #dien_thoai_gia_re #giá_rẻ #khuyen_mai #freeship #mobile #smartphone #điện_thoại_realme #realme</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000001795'),
