  ('00000000-0000-7000-0000-000278604009', 'Điện thoại Samsung Galaxy S25 Ultra (12GB/256GB), Điện thoại AI, Tìm kiếm thông minh, Video camera đêm Nightography, S Pen đa nhiệm - Đã kích hoạt bảo hành điện tử - Hàng Chính Hãng ', 23590000, 0, '<p> </p><p><span>Galaxy S25 Ultra - Cánh tay đắc lực AI<br />- Now Brief: Đưa ra các đề xuất được cá nhân hoá dựa trên phân tích thông minh về lịch trình riêng, sở thích và mục tiêu cá nhân.<br />- Seamless Actions across Apps: Ra câu lệnh bằng lời nói để xử lý tác vụ liên ứng dụng <br />- Camera góc siêu rộng 50MP: Nâng tầm nhiếp ảnh di động với Camera nâng cấp 50MP, giúp bắt trọn phong cảnh ở góc rộng chi tiết hơn 4x lần và sáng hơn 34% (so với S24 Ultra)<br />- Video camera đêm: Hệ thống khử nhiễu thông minh, giúp video thật sắc nét, chấp mọi điều kiện ánh sáng<br />- Vi xử lý thế hệ mới: Thế hệ Galaxy S với hiệu năng mạnh mẽ nhất cùng vi xử lý 3nm, lần đầu tiên có trên Galaxy - Snapdragon 8 Elite for Galaxy<br />- Hệ điều hành: Android 15, One UI 7<br />- Dung lượng RAM: 12GB<br />- Dung lượng bộ nhớ: 256GB</span></p><p><span><img src="https://salt.tikicdn.com/ts/tmp/d4/96/d5/29d6d90badbbd80b8034ee896fd367bc.jpg" alt="" width="750" height="419" /></span></p><p><img title="" src="https://salt.tikicdn.com/ts/tmp/2d/4f/8e/881d76e2c95a763c09d8252afdfb3a3a.jpg" alt="" width="750" height="457" /></p><p><img title="" src="https://salt.tikicdn.com/ts/tmp/d7/9c/95/a8381fccc4339d7405e0fbd5b7770eab.jpg" alt="" width="750" height="687" /></p><p><img title="" src="https://salt.tikicdn.com/ts/tmp/9b/8e/6f/bed50075b56ed70972d5c4251da753b1.jpg" alt="" width="750" height="375" /></p><p><img title="" src="https://salt.tikicdn.com/ts/tmp/8b/6d/76/8adc3777ae266660c9432a667cb52edf.jpg" alt="" width="750" height="375" /></p><p><img title="" src="https://salt.tikicdn.com/ts/tmp/e9/a7/1d/4821468734599fab9617c2bcff87c46c.jpg" alt="" width="750" height="421" /></p><p><img title="" src="https://salt.tikicdn.com/ts/tmp/bd/e5/76/9a857774d409943d493f2a0