  ('00000000-0000-7000-0000-000278627348', 'USB DATO chuẩn 3.0 dung lượng 128GB Bảo hành 5 năm - Hàng chính hãng', 139000, 0, '<div class="xdj266r x14z9mp xat24cr x1lziwak x1vvkbs x126k92a"><ul><li>Lưu trữ tiện lợi – Thiết kế tinh tế – Giá dễ tiếp cận</li><li><span class="html-span xexx8yu xyri2b x18d9i69 x1c1uobl x1hl2dhg x16tdsg8 x1vvkbs x3nfvp2 x1j61x8r x1fcty0u xdj266r xat24cr xm2jcoa x1mpyi22 xxymvpz xlup9mm x1kky2od"><img class="xz74otr x15mokao x1ga7v0g x16uus16 xbiv7yw" src="https://salt.tikicdn.com/ts/product/fb/87/94/776d5cd5a41ec18d295d0000b6596635.png" alt="" width="16" height="16" /></span> Chuẩn USB 2.0 ổn định, tương thích với mọi thiết bị: máy tính, laptop, loa ô tô, tivi…</li><li><img class="xz74otr x15mokao x1ga7v0g x16uus16 xbiv7yw" src="https://salt.tikicdn.com/ts/product/ec/81/dc/15ba5891c8ae9d716a3a767ee142a93c.png" alt="" width="16" height="16" /> Dung lượng 128GB – Đủ cho nhu cầu học tập, làm việc: Lưu tài liệu, giáo trình, hình ảnh, nhạc MP3, clip…</li><li><img class="xz74otr x15mokao x1ga7v0g x16uus16 xbiv7yw" src="https://salt.tikicdn.com/ts/product/5e/52/72/dcc46b60b1068998b09355db2f3f83e0.png" alt="" width="16" height="16" /> Nhiều màu thanh lịch, thời trang, nhỏ gọn, dễ dàng cất túi, mang theo học, làm hay đi công tác đều tiện</li><li><img class="xz74otr x15mokao x1ga7v0g x16uus16 xbiv7yw" src="https://salt.tikicdn.com/ts/product/78/fc/85/0c09e9bd14c9f4916f2a7e673b24b45b.png" alt="" width="16" height="16" /> Bền bỉ, đáng tin cậy, không lo lỗi vặt – USB Dato là thương hiệu được nhiều người tin dùng với bảo hành lên đến 5 năm</li><li><img class="xz74otr x15mokao x1ga7v0g x16uus16 xbiv7yw" src="https://salt.tikicdn.com/ts/product/84/41/20/bf00e1119e4c2495e62baf0fd7d8d89f.png" alt="" width="16" height="16" /> Phù hợp cho học sinh, sinh viên, dân văn phòng cần một chiếc USB đơn giản – dễ dùng – giá hợp lý</li><li><img class="xz74otr x15mokao x1ga7v0g x16uus16 xbiv7yw" src="https://salt.tikicdn.com/ts/product/fc/05/08/e20a950eaf79a2f32d871d87