  ('00000000-0000-7000-0000-000278635074', 'Điện thoại Xiaomi Redmi 13x (6GB/128GB) - Hàng chính hãng', 3269000, 0, '<article class="4ever-article"><ul><li><div>Màn hình 6.79 inch IPS LCD, độ phân giải Full HD+, tần số quét 90Hz cho hiển thị mượt mà</div></li><li><div>Chip MediaTek Helio G91 Ultra mạnh mẽ, xử lý đa nhiệm ổn định</div></li><li><div>RAM 6GB + bộ nhớ trong 128GB, hỗ trợ thẻ nhớ mở rộng, lưu trữ thoải mái</div></li><li><div>Camera sau kép: 108MP (chính) + 2MP (phụ) – chụp ảnh sắc nét, chi tiết cao</div></li><li><div>Camera trước 13MP – selfie rõ đẹp, gọi video mượt mà</div></li><li><div>Hệ điều hành Xiaomi HyperOS, tối ưu trải nghiệm người dùng</div></li><li><div>Hỗ trợ 2 Nano SIM, kết nối 4G LTE nhanh chóng</div></li><li><div>Pin 5000mAh, sạc nhanh 18W qua cổng USB Type-C tiện lợi</div></li><li><div>Thiết kế hiện đại, cầm nắm thoải mái, nhiều màu sắc thời trang</div></li><li><div>Bộ sản phẩm gồm: Thân máy, cáp USB Type-C</div></li></ul><p> </p><p class="p1">LƯU Ý KHI MUA HÀNG</p><p class="p1">Cảm ơn quý khách đã quan tâm đến sản phẩm bên shop, quý khách vui lòng dành ít thời gian đọc kĩ các thông tin sau:</p><p class="p1">️ Sản phẩm được bao test 7 ngày kể từ ngày nhận được sản phẩm và sẽ được đổi máy mới cùng model hoặc giá trị tương đương sau khi được thẩm định lỗi kĩ thuật.</p><p class="p1">️ Sản phẩm lỗi kĩ thuật được xác nhận bởi trung tâm bảo hành ủy quyền chính hãng (bằng văn bản); khách hàng có thể gửi lại shop để xác nhận lỗi hoặc tới trung tâm bảo hành ủy quyền để thẩm định lỗi.</p><p class="p1">️ Shop hỗ trợ phí vận chuyển trong vòng 7 ngày (kể từ ngày mình nhận hàng), sau 7 ngày shop chỉ hỗ trợ khách bảo hành (phí vận chuyển khách trả)</p><p class="p1">️ Sau 7 ngày bao test, sản phẩm vẫn nhận chính sách bảo hành theo quy định của nhà sản xuất (khách chịu phí vận chuyển tới shop bảo hành hộ hoặc tự đến trung tâm bảo hành).</p><p class="p1">️ Sản phẩm đổi trả phải còn nguyên hộp trùng imei, phụ kiện kèm theo máy không trầy xước, cháy nổ, đứt dây (nếu trầy xước shop không đổi phụ kiện mới)</p><p class="p1">️ Shop nhận đổi trả trong trường hợp hàng sai mẫu, size, màu do shop gửi. Bên shop chỉ giải quyết khiếu nại khi quý khách có video clip khi mở/nhận hàng.</p><p class="p1">️ Trong một số trường hợp sản phẩm đã được kích hoạt bảo hành tham gia chương trình khuyến mãi có giá tốt nhất cho khách hàng. Vui lòng chat với shop để được hỗ trợ thêm thông tin.</p><p class="p1">️ Khách hàng có nhu cầu xuất hóa đơn VAT, vui lòng liên hệ với gian hàng trực tiếp qua tin nhắn hoặc chat với Shop khi đơn hàng được giao thành công.</p><p class="p1"> Không nhận đổi trả khi sản phẩm bị hư hại do tác động ngoại lực từ người mua như móp, bể, trầy xước, nổ điện, rớt nước, rách tem bảo hành, không đầy đủ phụ kiện và hộp.</p><p class="p1"> Các sản phẩm bị khóa tài khoản như Gmail, account… Khách tự chịu phí mở khóa nếu không nhớ mật khẩu.</p><p class="p1"> Vì lượng hàng hoá nhiều shop không nhận đổi trả trong trường hợp khách không thích, không ưng màu, chất liệu; quý khách vui lòng đọc kĩ mô tả và xem hình ảnh cụ thể; nếu cần hãy chat với shop để được tư vấn.</p></article><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000001795'),
  ('00000000-0000-7000-0000-000278635094', 'Điện thoại Xiaomi Poco C71 (4GB/128GB) - Hàng chính hãng', 2480000, 0, '<ul><li>Màn hình <strong>6.88 inch IPS LCD</strong>, độ phân giải <strong>HD+</strong>, tần số quét <strong>120Hz</strong> cho hiển thị mượt mà</li><li>Chip <strong>UNISOC T7250 tám nhân</strong>, xử lý ổn định cho tác vụ hằng ngày</li><li>RAM <strong>4GB</strong> + bộ nhớ trong <strong>128GB</strong>, hỗ trợ mở rộng qua thẻ nhớ</li><li>Camera sau kép: <strong>32MP (chính)</strong> + camera phụ – chụp ảnh xóa phông tự nhiên</li><li>Camera trước <strong>8MP</strong> – selfie rõ nét, quay video <strong>Full HD</strong></li><li>Hệ điều hành <strong>Xiaomi HyperOS</strong>, tối ưu trải nghiệm mượt mà</li><li>Hỗ trợ <strong>2 Nano SIM</strong>, kết nối <strong>4G LTE</strong> nhanh chóng</li><li>Pin <strong>5200mAh</strong>, sạc nhanh <strong>15W</strong> qua cổng <strong>USB Type-C</strong></li><li>Thiết kế mỏng nhẹ <strong>8.26mm</strong>, cảm biến vân tay cạnh bên, có jack tai nghe <strong>3.5mm</strong></li><li>Bộ sản phẩm gồm: <strong>Thân máy, cáp USB Type-C, củ sạc</strong></li></ul><p> </p><p class="p1">LƯU Ý KHI MUA HÀNG</p><p class="p1">Cảm ơn quý khách đã quan tâm đến sản phẩm bên shop, quý khách vui lòng dành ít thời gian đọc kĩ các thông tin sau:</p><p class="p1">️ Sản phẩm được bao test 7 ngày kể từ ngày nhận được sản phẩm và sẽ được đổi máy mới cùng model hoặc giá trị tương đương sau khi được thẩm định lỗi kĩ thuật.</p><p class="p1">️ Sản phẩm lỗi kĩ thuật được xác nhận bởi trung tâm bảo hành ủy quyền chính hãng (bằng văn bản); khách hàng có thể gửi lại shop để xác nhận lỗi hoặc tới trung tâm bảo hành ủy quyền để thẩm định lỗi.</p><p class="p1">️ Shop hỗ trợ phí vận chuyển trong vòng 7 ngày (kể từ ngày mình nhận hàng), sau 7 ngày shop chỉ hỗ trợ khách bảo hành (phí vận chuyển khách trả)</p><p class="p1">️ Sau 7 ngày bao test, sản phẩm vẫn nhận chính sách bảo hành theo quy định của nhà sản xuất (khách chịu phí vận chuyển tới shop bảo hành hộ hoặc tự đến trung tâm bảo hành).</p><p class="p1">️ Sản phẩm đổi trả phải còn nguyên hộp trùng imei, phụ kiện kèm theo máy không trầy xước, cháy nổ, đứt dây (nếu trầy xước shop không đổi phụ kiện mới)</p><p class="p1">️ Shop nhận đổi trả trong trường hợp hàng sai mẫu, size, màu do shop gửi. Bên shop chỉ giải quyết khiếu nại khi quý khách có video clip khi mở/nhận hàng.</p><p class="p1">️ Trong một số trường hợp sản phẩm đã được kích hoạt bảo hành tham gia chương trình khuyến mãi có giá tốt nhất cho khách hàng. Vui lòng chat với shop để được hỗ trợ thêm thông tin.</p><p class="p1">️ Khách hàng có nhu cầu xuất hóa đơn VAT, vui lòng liên hệ với gian hàng trực tiếp qua tin nhắn hoặc chat với Shop khi đơn hàng được giao thành công.</p><p class="p1"> Không nhận đổi trả khi sản phẩm bị hư hại do tác động ngoại lực từ người mua như móp, bể, trầy xước, nổ điện, rớt nước, rách tem bảo hành, không đầy đủ phụ kiện và hộp.</p><p class="p1"> Các sản phẩm bị khóa tài khoản như Gmail, account… Khách tự chịu phí mở khóa nếu không nhớ mật khẩu.</p><p class="p1"> Vì lượng hàng hoá nhiều shop không nhận đổi trả trong trường hợp khách không thích, không ưng màu, chất liệu; quý khách vui lòng đọc kĩ mô tả và xem hình ảnh cụ thể; nếu cần hãy chat với shop để được tư vấn.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000001795'),
