  ('00000000-0000-7000-0000-000278642597', 'Tai nghe Samsung có dây EO-IA500BBEGWW 3.5mm - Hàng Chính Hãng', 220000, 0, '<p>Tai nghe có dây</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000001795'),
  ('00000000-0000-7000-0000-000278665998', 'Điện Thoại Xiaomi Redmi 15 8GB/128GB - Hàng Chính Hãng', 4589000, 0, '<p>Điện Thoại Xiaomi Redmi 15 8GB/128GB - Hàng Chính Hãng</p><p>Bộ sản phẩm bao gồm: Pin, sạc, cáp USB kiểu C, ốp lưng, hướng dẫn, cây tháo sim.</p><p><img src="" width="750" height="461" alt="vn-11134208-7ras8-mdpy2pza1q2735" /></p><p>Màn hình 144Hz giúp mọi trải nghiệm mượt mà</p><p>- Trang bị màn hình IPS LCD 6.9inches mang đến không gian hiển thị cực lớn, hoàn hảo cho mọi nhu cầu giải trí từ xem phim, chơi game đến đọc tin tức. Màn hình đạt độ phân giải Full HD+ (1080 x 2340 pixels) nhờ đó hình ảnh luôn sắc nét, màu sắc chân thực và tạo cảm giác dễ chịu khi nhìn lâu.</p><p>- Màn hình Redmi 15 gây ấn tượng mạnh mẽ với tần số quét 144Hz, đảm bảo mọi thao tác vuốt chạm, cuộn trang hay chơi game tốc độ cao đều diễn ra siêu mượt mà.</p><p> </p><p>Camera 50MP sắc nét, selfie đẹp tự nhiên</p><p>- Trang bị camera chính 50 MP khẩu độ f/1.8, đảm bảo ảnh chụp sắc nét và chi tiết sống động trong điều kiện đủ sáng. Dù chỉ được trang bị một camera phụ đơn giản, thiết bị vẫn tích hợp đầy đủ các chế độ chụp thông minh như Panorama, HDR, làm đẹp, góc rộng và đặc biệt là chế độ chụp đêm, giúp bạn thỏa sức sáng tạo trong mọi bối cảnh.</p><p>- Redmi 15 mang đến khả năng quay video Full HD 1080p và HD 720p mượt mà với tốc độ 30 khung hình/giây. Camera trước 8MP tích hợp chế độ làm đẹp thông minh, giúp bạn tự tin tỏa sáng trong mọi bức ảnh selfie và các cuộc gọi video.</p><p> </p><p>Hiệu năng ổn định, đa nhiệm mượt mà</p><p>- Trang bị vi xử lý Snapdragon 685 mang lại hiệu năng ổn định và mượt mà trong mọi tác vụ, máy không chỉ xử lý đa nhiệm trơn tru mà còn đảm bảo tiết kiệm pin. Nhờ đó, người dùng có thể thoải mái lướt web, làm việc, học tập hay chơi game phổ biến mà không lo giật lag.</p><p> </p><p>Pin 7000 mAh bền bỉ, sạc nhanh tiện lợi</p><p>- Trang bị viên pin 7000mAh siêu lớn người dùng có thể yên tâm trải nghiệm trọn vẹn suốt cả ngày mà không lo gián đoạn. Ngoài ra máy còn trang bị công nghệ sạc nhanh 33W giúp rút ngắn thời gian sạc cho máy.</p><p>Điện Thoại Xiaomi Redmi 15 8GB/128GB - Hàng Chính Hãng</p><p> </p><p>Cảm ơn quý khách đã quan tâm đến sản phẩm bên shop, quý khách vui lòng dành ít thời gian đọc kĩ chính sách bảo hành đổi trả:</p><p>- Sản phẩm được bao test 7 ngày kể từ ngày nhận được sản phẩm và sẽ được đổi máy mới cùng model hoặc giá trị tương đương sau khi được thẩm định lỗi kĩ thuật.</p><p>- Sản phẩm lỗi kĩ thuật được xác nhận bởi trung tâm bảo hành ủy quyền chính hãng (bằng văn bản); khách hàng có thể gửi lại shop để xác nhận lỗi hoặc tới trạm bảo hành gần nhất để thẩm định lỗi.</p><p>- Sản phẩm đổi trả phải còn nguyên hiện trạng máy không trầy xước, không bể vỡ, vô nước, gãy chân sim, khung thẻ nhớ… (tất cả các tác động ngoại lực từ phía khách hàng đều TỪ CHỐI BẢO HÀNH)</p><p>- Sản phẩm đổi trả phải còn nguyên hộp trùng imei, phụ kiện kèm theo máy không trầy xước, cháy nổ, đứt dây (nếu trầy xước shop không đổi phụ kiện mới)</p><p>- Sau 7 ngày bao test, sản phẩm vẫn nhận chính sách bảo hành 18 tháng kể từ ngày kích hoạt bảo hành (khách chịu phí vận chuyển tới shop bảo hành hộ hoặc tự đến trung tâm bảo hành gần nhất để được hỗ trợ)</p><p>- Trong một số trường hợp sản phẩm đã được kích hoạt bảo hành điện tử để tham gia chương trình khuyến mãi có giá tốt cho khách hàng. Vui lòng chat với nhân viên tư vấn để được hỗ trợ thêm thông tin.</p><p>- Sản phẩm bị TỪ CHỐI BẢO HÀNH khi cháy nổ, bể vỡ, tác động ngoại lực vào thân và bên trong máy, có thay đổi sửa chữa bên ngoài.</p><p>- Các sản phẩm bị khóa tài khoản như Gmail, Samsung account… Khách tự chịu phí mở khóa nếu không nhớ mật khẩu.</p><p>Điện Thoại Xiaomi Redmi 15 8GB/128GB - Hàng Chính Hãng</p><p> </p><p>#honghanhmobile #honghanhmobilemall #hhm #dienthoaichinhhanghonghanh #xiaomi_redmi_15 #redmi_15 #điện_thoại #dienthoai #di_động #didong #điện_thoại_di_động #dien_thoai_di_dong #điện_thoại_chính_hãng #hàng_chính_hãng #điện_thoại_giá_rẻ #dien_thoai_gia_re #giá_rẻ #khuyen_mai #freeship #mobile #smartphone #điện_thoại_xiaomi #xiaomi</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000001795'),
  ('00000000-0000-7000-0000-000278672823', 'Điện thoại Samsung Galaxy A17 LTE (8GB/128GB) - Hàng chính hãng', 4819000, 0, '<article class="text-token-text-primary w-full focus:outline-none scroll-mt-[calc(var(--header-height)+min(200px,max(70px,20svh)))]"><div class="text-base my-auto mx-auto pb-10 [--thread-content-margin:--spacing(4)] thread-sm:[--thread-content-margin:--spacing(6)] thread-lg:[--thread-content-margin:--spacing(16)] px-(--thread-content-margin)"><div class="[--thread-content-max-width:40rem] thread-lg:[--thread-content-max-width:48rem] mx-auto max-w-(--thread-content-max-width) flex-1 group/turn-messages focus-visible:outline-hidden relative flex w-full min-w-0 flex-col agent-turn"><div class="flex max-w-full flex-col grow"><div class="min-h-8 text-message relative flex w-full flex-col items-end gap-2 text-start break-words whitespace-normal [.text-message+&amp;]:mt-5"><div class="flex w-full flex-col gap-1 empty:hidden first:pt-[3px]"><div class="markdown prose dark:prose-invert w-full break-words dark markdown-new-styling"><ul><li>Màn hình <strong>6.7 inch Super AMOLED</strong>, độ phân giải <strong>Full HD+</strong>, tần số quét <strong>90Hz</strong> hiển thị mượt mà</li><li>RAM <strong>8GB</strong> + bộ nhớ trong <strong>128GB</strong>, hỗ trợ thẻ nhớ mở rộng tiện lợi</li><li>Camera sau <strong>3 ống kính</strong>: 50MP (chính, OIS) + 5MP (góc rộng) + 2MP (macro), camera trước <strong>13MP</strong></li><li>Pin <strong>5000mAh</strong>, sạc nhanh <strong>25W</strong></li><li>Hỗ trợ <strong>2 SIM</strong>, kết nối <strong>4G LTE ổn định</strong></li><li><strong>Cảm biến vân tay cạnh bên</strong>, hỗ trợ mở khóa khuôn mặt nhanh chóng</li><li>Thiết kế <strong>mỏng nhẹ, nhiều màu sắc trẻ trung</strong></li><li>Bộ sản phẩm: <strong>Thân máy, cáp USB-C, củ sạc, hướng dẫn sử dụng</strong></li></ul><p> </p><p class="p1">LƯU Ý KHI MUA HÀNG</p><p class="p1">Cảm ơn quý khách đã quan tâm đến sản phẩm bên shop, quý khách vui lòng dành ít thời gian đọc kĩ các thông tin sau:</p><p class="p1">️ Sản phẩm được bao test 7 ngày kể từ ngày nhận được sản phẩm và sẽ được đổi máy mới cùng model hoặc giá trị tương đương sau khi được thẩm định lỗi kĩ thuật.</p><p class="p1">️ Sản phẩm lỗi kĩ thuật được xác nhận bởi trung tâm bảo hành ủy quyền chính hãng (bằng văn bản); khách hàng có thể gửi lại shop để xác nhận lỗi hoặc tới trung tâm bảo hành ủy quyền để thẩm định lỗi.</p><p class="p1">️ Shop hỗ trợ phí vận chuyển trong vòng 7 ngày (kể từ ngày mình nhận hàng), sau 7 ngày shop chỉ hỗ trợ khách bảo hành (phí vận chuyển khách trả)</p><p class="p1">️ Sau 7 ngày bao test, sản phẩm vẫn nhận chính sách bảo hành theo quy định của nhà sản xuất (khách chịu phí vận chuyển tới shop bảo hành hộ hoặc tự đến trung tâm bảo hành).</p><p class="p1">️ Sản phẩm đổi trả phải còn nguyên hộp trùng imei, phụ kiện kèm theo máy không trầy xước, cháy nổ, đứt dây (nếu trầy xước shop không đổi phụ kiện mới)</p><p class="p1">️ Shop nhận đổi trả trong trường hợp hàng sai mẫu, size, màu do shop gửi. Bên shop chỉ giải quyết khiếu nại khi quý khách có video clip khi mở/nhận hàng.</p><p class="p1">️ Trong một số trường hợp sản phẩm đã được kích hoạt bảo hành tham gia chương trình khuyến mãi có giá tốt nhất cho khách hàng. Vui lòng chat với shop để được hỗ trợ thêm thông tin.</p><p class="p1">️ Khách hàng có nhu cầu xuất hóa đơn VAT, vui lòng liên hệ với gian hàng trực tiếp qua tin nhắn hoặc chat với Shop khi đơn hàng được giao thành công.</p><p class="p1"> Không nhận đổi trả khi sản phẩm bị hư hại do tác động ngoại lực từ người mua như móp, bể, trầy xước, nổ điện, rớt nước, rách tem bảo hành, không đầy đủ phụ kiện và hộp.</p><p class="p1"> Các sản phẩm bị khóa tài khoản như Gmail, account… Khách tự chịu phí mở khóa nếu không nhớ mật khẩu.</p><p class="p1"> Vì lượng hàng hoá nhiều shop không nhận đổi trả trong trường hợp khách không thích, không ưng màu, chất liệu; quý khách vui lòng đọc kĩ mô tả và xem hình ảnh cụ thể; nếu cần hãy chat với shop để được tư vấn.</p><p> </p></div></div></div></div><div class="flex min-h-[46px] justify-start"> </div><div class="mt-3 w-full empty:hidden"><div class="text-center"> </div></div></div></div></article><div class="pointer-events-none h-px w-px"> </div><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000001795'),
