  ('00000000-0000-7000-0000-000278721932', 'Máy nước nóng trực tiếp Panasonic 4500W DH-4US1VS - Hàng chính hãng', 3390000, 0, '<p class="short-article__title">Đặc điểm nổi bật</p><ul><li>Có thiết kế <strong>nhỏ gọn</strong>, <strong>đẹp mắt</strong>, phù hợp với mọi không gian nhà tắm.</li><li>Làm nóng nước nhờ <strong>công suất hoạt động mạnh mẽ</strong> và <strong>cơ chế làm nóng trực tiếp</strong>.</li><li>Vòi sen có <strong>3 chế độ phun</strong> dễ dàng lựa chọn được chế độ phù hợp với nhu cầu sử dụng.</li><li>Đảm bảo an toàn nhờ <strong>cầu dao chống rò rỉ điện ELCB</strong>.</li><li>Vỏ máy <strong>chống bụi</strong>, <strong>chống thấm nước</strong> chuẩn IP25.</li></ul><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000003866'),
  ('00000000-0000-7000-0000-000278721963', 'Máy nước nóng trực tiếp Panasonic 4500W DH-4US1VW - Hàng chính hãng', 3190000, 0, '<p class="short-article__title"><span class="ttl title_feature">Tính năng nổi bật:</span></p><ul><li>Công suất định mức : 4500W</li><li>Kháng khuẩn bằng Vật liệu tinh thể Ag+</li><li>Cảm biến lưu lượng nước</li><li>Cầu dao chống rò điện (ELB) tích hợp</li><li>Bảo vệ trước các mối nguy từ lửa và điện với 9 tính năng an toàn</li><li>Chế độ phun nhẹ nhàng và dễ chịu với vòi sen 3 chế độ</li></ul><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000003866'),
  ('00000000-0000-7000-0000-000278726149', 'Máy giặt LG AI DD Inverter 15 Kg F2515SNTG/ 17kg F2517SNTG - Hàng Chính Hãng - Mới 100%', 14980000, 0, '<article class="4ever-article"><p>* LƯU Ý : SHOP CHỈ HỖ TRỢ GIAO MIỄN PHÍ Ở KHU VỰC HCM - ĐỐI VỚI CÁC TỈNH SHOP SẼ BÁO PHÍ CHO KHÁCH TRƯỚC KHI GIAO - </p><h3> </h3><h3>Máy giặt LG AI DD Inverter 15 Kg F2515SNTG/ 17kg F2517SNTG  có khối lượng giặt 15 kg/17kg thích hợp với gia đình có trên 7 thành viên. Máy có thiết kế hiện đại, tích hợp công nghệ Allergy Care diệt khuẩn, công nghệ AI Smart Wash thông minh,... </h3><p>Ngoài ra, máy còn được trang bị nhiều tiện ích hỗ trợ người dùng, kết hợp với công nghệ Inverter giúp tiết kiệm hiệu quả điện năng và nước.</p><p> </p><h2>Thiết kế</h2><p>- Máy giặt LG AI DD Inverter 15 Kg F2515SNTG/ 17kg F2517SNTG  sở hữu thiết kế cửa ngang hiện đại, chắc chắn. Máy có tông màu đen sang trọng, tạo điểm nhấn cho không gian phòng giặt nhà bạn.</p><p> </p><p>- Cửa máy làm bằng kính cường lực 2 lớp bền bỉ. Vỏ máy giặt làm từ kim loại sơn tĩnh điện có độ bền cao, dễ lau dọn khi bám bẩn. </p><p>- Lồng giặt được làm từ thép không gỉ có khả năng hạn chế hao mòn và tránh cặn bột giặt bám lại sau quá trình hoạt động.</p><p>- Máy giặt được trang bị bảng điều khiển nút nhấn, núm xoay, cảm ứng kết hợp chú thích song ngữ Anh - Việt, màn hình hiển thị rõ nét giúp bạn tùy chọn các chức năng dễ dàng và chính xác.</p><p><img src="https://salt.tikicdn.com/ts/product/42/7e/ee/6b08c39835cc44cf770859f7548ee28a.png" alt="427eeeecc667b8d4c5a1549e7bb916f2.png" /></p><p> </p><p>*Hình ảnh chỉ mang tính chất minh họa</p><p> </p><p> </p><h2>Khối lượng giặt và chương trình</h2><p>- Máy giặt LG Inverter có khối lượng giặt 15 kg/17kg  thích hợp với gia đình trên 7 thành viên. </p><p> </p><p>- Máy giặt LG tích hợp nhiều chương trình hoạt động khác nhau: giặt ngừa dị ứng, TurboWash 39, giặt thông minh AI Wash,... hỗ trợ việc giặt giũ của gia đình nhẹ nhàng hơn.</p><p> </p><p><img src="https://salt.tikicdn.com/ts/product/33/b8