  ('00000000-0000-7000-0000-000278726186', 'Điện thoại Xiaomi 15T Pro 5G (12GB/512GB) - Hàng chính hãng', 17340000, 0, '<article class="4ever-article"><ul><li><div>Màn hình AMOLED 6,83 inch, độ phân giải 1.5K (2772×1280), tần số quét 144Hz mượt mà</div></li><li><div>Chip MediaTek Dimensity 9400+ – hiệu năng cực mạnh, tối ưu cho game và đa nhiệm</div></li><li><div>Camera Leica 3 ống kính: 50MP (chính, OIS) + 50MP tele 5x + 12MP góc siêu rộng</div></li><li><div>Camera selfie 32MP, sắc nét, hỗ trợ AI làm đẹp tự nhiên</div></li><li><div>Pin 5500mAh, sạc nhanh 90W có dây và 50W không dây</div></li><li><div>Hệ điều hành HyperOS (Android 15) – giao diện mượt, nhiều tính năng thông minh</div></li><li><div>Chuẩn kháng nước &amp; bụi IP68, khung kim loại, mặt kính Gorilla Glass 7i bền bỉ</div></li><li><div>Hỗ trợ 5G, Wi-Fi 7, Bluetooth thế hệ mới, đảm bảo tốc độ và ổn định kết nối</div></li><li><div>Thiết kế sang trọng, mỏng nhẹ (~7.96mm, ~210g), cầm nắm thoải mái</div></li><li><div>Bộ sản phẩm gồm: Thân máy, cáp sạc, hướng dẫn sử dụng</div></li></ul><p> </p><p class="p1">LƯU Ý KHI MUA HÀNG</p><p class="p1">Cảm ơn quý khách đã quan tâm đến sản phẩm bên shop, quý khách vui lòng dành ít thời gian đọc kĩ các thông tin sau:</p><p class="p1">️ Sản phẩm được bao test 7 ngày kể từ ngày nhận được sản phẩm và sẽ được đổi máy mới cùng model hoặc giá trị tương đương sau khi được thẩm định lỗi kĩ thuật.</p><p class="p1">️ Sản phẩm lỗi kĩ thuật được xác nhận bởi trung tâm bảo hành ủy quyền chính hãng (bằng văn bản); khách hàng có thể gửi lại shop để xác nhận lỗi hoặc tới trung tâm bảo hành ủy quyền để thẩm định lỗi.</p><p class="p1">️ Shop hỗ trợ phí vận chuyển trong vòng 7 ngày (kể từ ngày mình nhận hàng), sau 7 ngày shop chỉ hỗ trợ khách bảo hành (phí vận chuyển khách trả)</p><p class="p1">️ Sau 7 ngày bao test, sản phẩm vẫn nhận chính sách bảo hành theo quy định của nhà sản xuất (khách chịu phí vận chuyển tới shop bảo hành hộ hoặc tự đến trung tâm bảo hành).</p><p class="p1">️ Sản phẩm