="https://salt.tikicdn.com/cache/w750/ts/product/a5/2f/a5/0624a36145a5da559ba7cb649d4b3e09.jpg" alt="a52fa53d0a560ee544e2cb53cbb6bb4d.jpg" /></p><h3>Về chất liệu</h3><p>Máy giặt sấy LG F2515RNTG sử dụng cửa kính cường lực với màu trong suốt giúp dễ dàng theo dõi quá trình hoạt động của máy. Thanh nâng được làm từ thép không gỉ bền bỉ, hạn chế bám bẩn và dễ dàng vệ sinh.</p><p><img src="https://salt.tikicdn.com/cache/w750/ts/product/28/d2/ea/3659eb0b618b0f357a164e7a0dc3d23d.jpg" alt="28d2eab3b7ee1ed1981499b51bd4a3d8.jpg" /></p><p>Lồng giặt làm từ thép không gỉ với kích thước lớn hơn cho phép giặt hoặc sấy một chiếc chăn lớn hoặc bộ ga gối mà không cần chia thành nhiều mẻ, tiết kiệm thời gian và năng lượng.</p><h3>Công nghệ giặt, sấy trên máy</h3><p>Máy giặt sấy LG được áp dụng những công nghệ sau:</p><p>Công nghệ AI DD giúp xác định khối lượng và loại vải của quần áo, từ đó đưa ra chương trình và thời gian giặt phù hợp nhất. Chế độ sấy của máy được trang bị công nghệ AI giúp bảo vệ sợi vải và gia tăng tuổi thọ cho trang phục lên đến 15%.</p><p>Chương trình giặt TurboWash cho phép giặt mạnh mẽ chỉ trong 55 phút nhằm loại bỏ mọi vết bẩn cứng đầu, mang lại cho quần áo sự sạch sẽ như mới. Chu trình này sử dụng công nghệ giặt phun tia vừa giặt sạch, vừa tiết kiệm nước.</p><p>LG F2515RNTG còn sở hữu công nghệ Steam giúp diệt khuẩn lên đến 99,9%, loại bỏ mùi hôi và bụi bẩn trên sợi vải.</p><h3>Động cơ truyền động trực tiếp </h3><p>Máy giặt sấy LG được áp dụng công nghệ Inverter hoạt động ổn định, êm ái và tiết kiệm điện năng tối đa. Động cơ truyền động trực tiếp bằng bộ đảo lưu mang lại khả năng vận hành bền bỉ trong nhiều năm.</p><p><img src="https://salt.tikicdn.com/cache/w750/ts/product/11/c0/50/a5ae7d86715e06b2ea0e8f016f8d65fa.jpg" alt="11c0505896628acd33a1cb37d3ac9dbc.jpg" /></p><h3>Tiện ích trên máy giặt sấy</h3><p>Người dùng có thể điều khiển máy giặt sấy từ xa qua qua ứng dụng ThinQ cài trên điện thoại có kết nối Wifi.</p><p>Chỉ cần ra lệnh bằng giọng nói như “Giặt chu trình nào rồi?”, AI sẽ tự động nhận diện và báo cáo cho bạn, rất tiện lợi và nhanh chóng.</p><p><img src="https://salt.tikicdn.com/cache/w750/ts/product/9f/70/3b/4c73cef3c4fa0d6018ab7281cb5112ef.jpg" alt="9f703bb58b1237b2a293d41702e67df3.jpg" /></p><p>Lưu ý: Hình ảnh sản phẩm chỉ có tính chất minh họa, chi tiết sản phẩm, màu sắc, thiết kế và thông số kỹ thuật có thể thay đổi tùy theo sản phẩm thực tế mà không cần thông báo trước.</p></article><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000003862'),
  ('00000000-0000-7000-0000-000278726370', 'Điện thoại Xiaomi 15T 5G (12GB/256GB) - Hàng chính hãng', 12190000, 0, '<article class="4ever-article"><ul><li><div>Màn hình AMOLED 6,83 inch, độ phân giải 2772×1280, tần số quét 120Hz</div></li><li><div>Chip MediaTek Dimensity 8400-Ultra mạnh mẽ, tối ưu hiệu năng và tiết kiệm pin</div></li><li><div>RAM 12GB cùng bộ nhớ trong 512GB (chuẩn UFS 4.1)</div></li><li><div>Cụm 3 camera sau Leica: 50MP (chính, OIS) + 50MP (tele) + 12MP (siêu rộng)</div></li><li><div>Camera trước 20MP cho ảnh selfie sắc nét</div></li><li><div>Viên pin 5500mAh, hỗ trợ sạc nhanh 67W HyperCharge</div></li><li><div>Hệ điều hành HyperOS – giao diện mượt mà, nhiều tính năng tiện ích</div></li><li><div>Kết nối hiện đại: 5G, Wi-Fi 6E, Bluetooth thế hệ mới</div></li><li><div>Thiết kế mỏng nhẹ (~7.5mm, ~194g), kính Gorilla Glass 7i bền bỉ</div></li><li><div>Bộ sản phẩm gồm: Thân máy, cáp USB-C và sách hướng dẫn</div></li></ul><p> </p><p class="p1">LƯU Ý KHI MUA HÀNG</p><p class="p1">Cảm ơn quý khách đã quan tâm đến sản phẩm bên shop, quý khách vui lòng dành ít thời gian đọc kĩ các thông tin sau:</p><p class="p1">️ Sản phẩm được bao test 7 ngày kể từ ngày nhận được sản phẩm và sẽ được đổi máy mới cùng model hoặc giá trị tương đương sau khi được thẩm định lỗi kĩ thuật.</p><p class="p1">️ Sản phẩm lỗi kĩ thuật được xác nhận bởi trung tâm bảo hành ủy quyền chính hãng (bằng văn bản); khách hàng có thể gửi lại shop để xác nhận lỗi hoặc tới trung tâm bảo hành ủy quyền để thẩm định lỗi.</p><p class="p1">️ Shop hỗ trợ phí vận chuyển trong vòng 7 ngày (kể từ ngày mình nhận hàng), sau 7 ngày shop chỉ hỗ trợ khách bảo hành (phí vận chuyển khách trả)</p><p class="p1">️ Sau 7 ngày bao test, sản phẩm vẫn nhận chính sách bảo hành theo quy định của nhà sản xuất (khách chịu phí vận chuyển tới shop bảo hành hộ hoặc tự đến trung tâm bảo hành).</p><p class="p1">️ Sản phẩm đổi trả phải còn nguyên hộp trùng imei, phụ kiện kèm theo máy không trầy xước, cháy nổ, đứt dây (nếu trầy xư