  ('00000000-0000-7000-0000-000278726968', 'Tháp giặt sấy LG 14kg sấy 10 kg WT1410NHEG - Hàng Chính Hãng - Mới 100%', 41334000, 0, '<article class="4ever-article"><article class="4ever-article"><p><img src="https://vn-live-01.slatic.net/p/9708fd1d37fca711dbaed92234a664c0.jpg" alt="9708fd1d37fca711dbaed92234a664c0.jpg" /></p><p>Bảng điều khiển trung tâm cũng được trang bị màn hình hiển thị LED rõ ràng, giúp bạn dễ dàng theo dõi và điều chỉnh các cài đặt.</p><h3>Mức tiêu thụ điện năng </h3><p>Với công nghệ Inverter và các tính năng tiết kiệm năng lượng, LG WashTower Inverter WT1410NHEG giúp giảm mức tiêu thụ điện năng hiệu quả, giúp bạn tiết kiệm chi phí điện hàng tháng.</p><p>Máy sấy quần áo có hiệu suất sử dụng điện 18.62 Wh/kg, đảm bảo giặt giũ hiệu quả mà không tốn nhiều năng lượng.</p><p>Lưu ý: Hình ảnh sản phẩm chỉ có tính chất minh họa, chi tiết sản phẩm, màu sắc, thiết kế và thông số kỹ thuật có thể thay đổi tùy theo sản phẩm thực tế mà không cần thông báo trước.</p></article></article><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000003862'),
  ('00000000-0000-7000-0000-000278727231', 'Máy giặt LG Inverter 9 kg FV1409S4M1 - Hàng Chính Hãng - Mới 100%', 7974000, 0, '<article class="4ever-article"><p> </p><h1>Máy giặt lồng ngang LG AIDDTM Inverter 9kg màu đen FV1409S4M1</h1><p>Tính năng chính</p><ul><li><div>AI DD tối ưu hóa chuyển động giặt qua cảm biến tự động xác định chất liệu áo quần</div></li><li><div>Thanh nâng bằng thép không gỉ ít bám bẩn</div></li><li><div>Giặt hơi nước Steam giảm nhăn, diệt khuẩn, ngăn dị ứng</div></li><li><div>Khối lượng giặt lớn hơn với cùng diện tích nhờ thiết kế cải tiến</div></li><li><div>Cửa kính cường lực bền bỉ hơn và dễ dàng làm sạch</div></li></ul><p>TurboWash</p><h2>Tiết kiệm thời gian để tận hưởng cuộc sống tốt đẹp hơn</h2><p> </p><p> </p><p>Công nghệ TurboWash làm sạch đồ giặt của bạn trong 59 phút. Dành ít thời gian hơn để giặt giũ và nhiều thời gian hơn để tận hưởng cuộc sống.</p><p>Đồ giặt đang được giặt trong máy giặt.</p><p> </p><p>AI DD không chỉ phát hiện trọng lượng mà còn cảm nhận độ mềm của vải và tự chọn các chuyển động tối ưu cho vải.</p><p><img src="https://salt.tikicdn.com/cache/w750/ts/product/b4/43/6f/a50f48592172d7bb5e1051cd3c0945d9.jpg" alt="b4436fdfa648ba8113281c541884b829.jpg" /></p><p> </p><h2>30% Vết nhăn ít hơn</h2><p>Các vết nhăn hình thành trong quá trình mất nước sẽ biến mất thông qua hơi nước trong chuyển động nhào lộn.</p><p><img src="https://salt.tikicdn.com/cache/w750/ts/product/b8/d9/37/00a17058eaf477a8716e48628c530e12.jpg" alt="b8d9372d98dbc0b3977ca4b86d890663.jpg" /></p><p> </p><h2>99,9% Loại bỏ chất gây dị ứng</h2><p>Hơi nước loại bỏ chất gây dị ứng đến 99,9%.</p><p>**Chu trình Chăm sóc Dị ứng có chứng nhận của BAF (British Allergy Foundation) làm giảm 99,9% dị ứng mạt bụi nhà. *Thử nghiệm bởi Intertek vào tháng 12 năm 2018, dựa trên tiêu chuẩn AATCC. Chu kỳ vải bông với tùy chọn ‘Chăm sóc vết nhăn’ (3 loại áo sơ-mi hỗn hợp) so với chu trình vải bông không có tùy chọn. Kết quả có thể khác nhau tùy thuộc vào quần áo và môi trường. *Chức năng Chăm sóc vết nhăn có sẵn dưới dạng tùy chọn trong 6 chu trình.</p><p>Dung tích lớn hơn</p><h2>Dung tích lớn hơn trong cùng không gian</h2><p>Dung tích lồng giặt lớn hơn có cùng kích cỡ</p><p> </p><p>*Chiều sâu 550mm được mô tả trong hình ảnh không bao gồm kích thước cửa của máy giặt.</p><p> </p><p>Độ bền</p><h2>Bền và sạch hơn</h2><p>Cửa kính cường lực bền và thanh lịch bên ngoài và cần nâng bằng thép không gỉ bền và hợp vệ sinh.</p><p>*Thử nghiệm bởi Intertek vào tháng 7 năm 2013. Tác dụng diệt khuẩn đối với P.aeruginosa của thép không gỉ so với lượng ban đầu trong 12 ngày.</p><p> </p><p>Thiết kế</p><h2>Hình thức ưa nhìn và thanh lịch hơn</h2><p>Hình thức ưa nhìn hơn và kích thước núm vặn lớn hơn với phần hoàn thiện bằng kim loại.</p><p>Giảm rung, giảm ồn1</p><p> </p><h2>Giảm rung, giảm ồn</h2><p>Động cơ dẫn động trực tiếp là trái tim mang đến sức mạnh cho máy giặt, có độ tin cậy rất cao và cực kì êm ái. Chúng tôi biết đây là một trong những động cơ máy giặt tốt nhất trên thị trường, đó là lý do vì sao tất cả máy giặt của chúng tôi đều có thời gian bảo hành 10 năm cho động cơ. Quả là một mức bảo hành tuyệt vời phải không?</p><p>*TWINWash Mini không có sẵn trên toàn quốc gia hoặc trong tất cả các nhà bán lẻ địa phương.</p><p> </p><h2>Hiệu quả năng lượng cao hơn và hư hỏng thấp hơn</h2><p> </p><p> </p><p>Giảm thời gian chu trình và hư hỏng quần áo với mức năng lượng thấp hơn.</p><p>Hiệu quả năng lượng cao hơn và hư hỏng thấp hơn1</p><p> </p><p> </p><p> </p><p> </p><p> </p><p> </p><p> </p><p> </p><p> </p><p><img src="https://salt.tikicdn.com/cache/w750/ts/product/31/52/98/db5410e353f92530b785ae5c548bc452.jpg" alt="315298c56440a087234516cc2eb0a622.jpg" /></p><p> </p><p> </p><p> </p><p>ThinQ</p><h2>Thiết bị thông minh</h2><p>Với công nghệ ThinQ, máy giặt của bạn sẽ thông minh hơn từ việc vận hành đồ giặt từ xa đến việc tải xuống chu trình giặt bổ sung. Dễ dàng tương tác với máy giặt và truy cập các cải tiến mới nhất với Kết nối Wi-Fi.</p><p>*Hỗ trợ cho thiết bị