<p>Công nghệ</p><p>NVIDIA G-SYNC Compatible </p><p>VESA Certified AdaptiveSync</p><p>AMD FreeSync Premium Pro</p><p>LG OLED, liên tục đổi mới</p><p>Màn hình UltraGear rực rỡ của chúng tôi với công nghệ Micro Lens Array+ tự hào có OLED tươi sáng hơn với độ sáng tối đa 1300 nit và tốc độ quét đáng ngạc nhiên 480Hz, Ngay cả trong những khung cảnh chơi game tối nhất, màn hình vẫn mang lại độ sâu màu đen chi tiết, trong khi tỷ lệ màn hình cao và gam màu rộng mang lại màu sắc sống động, tạo ra trải nghiệm chơi game vô song.</p><p> </p><p>Tần số quét</p><p>480Hz nhanh nhất</p><p>DisplayPort 2.1 mới nhất</p><p>QHD@480Hz</p><p>OLED sáng nhất</p><p>Với công nghệ MLA+</p><p>Màu siêu đen</p><p>DisplayHDR True Black 400</p><p>*Độ sáng SDR sáng hơn 37,5% so với các màn hình OLED trước đây với MLA, 27GR95QE, 45GR95QE dựa trên các thông số đã xuất bản.</p><p>*480Hz là tần số quét nhanh nhất thế giới dựa trên các thông số đã xuất bản của màn hình OLED kể từ tháng 11 năm 2024. (241112)</p><p>OLED nhanh nhất, 480Hz và 0.03ms (GtG)</p><p>Tốc độ nhanh như chớp</p><p>Màn hình UltraGear OLED mang đến sức mạnh vô song với tần số quét 480Hz, đem lại hình ảnh siêu mượt mà và thời gian phản hồi 0.03ms (GtG) để chơi game sắc nét, không có bóng mờ, giúp bạn có lợi thế cạnh tranh.</p><p> </p><p>Khung cảnh trò chơi đua xe có tốc độ phản hồi cực nhanh 0.03ms (GtG) và tần số quét 480Hz nhanh chóng.</p><p> </p><p>*Hình ảnh được mô phỏng để có thể hiểu tính năng rõ hơn và có thể khác biệt so với trải nghiệm sử dụng thực tế.</p><p>*480Hz là tần số quét nhanh nhất thế giới dựa trên các thông số đã xuất bản của màn hình OLED kể từ tháng 11 năm 2024. (241112)</p><p>DP 2.1, không còn phải chờ đợi nữa</p><p>Công nghệ DisplayPort 2.1 mới nhất thiết lập tiêu chuẩn mới cho việc chơi game thế hệ mới. Đây là giao diện tiên tiến dự kiến ​​sẽ được giới thiệu cùng với thế hệ GPU tiếp theo, cho phép chơi game tốc độ cao ở tần số 480Hz với độ phân giải QHD.</p><p> </p><p><img src="" width="875" height="875" alt="vn-11134208-7ras8-mcll7tqahkd863" /><img src="" width="875" height="875" alt="vn-11134208-7ras8-mcll7tqaiyxoc3" /><img src="" width="875" height="875" alt="vn-11134208-7ras8-mcll7tqakdi4c9" /><img src="" width="875" height="875" alt="vn-11134208-7ras8-mcll7tqals2kb4" /><img src="" width="875" height="875" alt="vn-11134208-7ras8-mcll7tqan6n0e0" /><img src="" width="875" height="875" alt="vn-11134208-7ras8-mcll7tqaol7g19" /><img src="" width="875" height="875" alt="vn-11134208-7ras8-mcll7tqapzrwc8" /><img src="" width="875" height="875" alt="vn-11134208-7ras8-mcll7tqareccb3" /><img src="" width="875" height="875" alt="vn-11134208-7ras8-mcll8y5b833h9d" /><img src="" width="875" height="875" alt="vn-11134208-7ras8-mcll8y5b9hnx73" /><img src="" width="875" height="875" alt="vn-11134208-7ras8-mcll8y5baw8d64" /><img src="" width="875" height="875" alt="vn-11134208-7ras8-mcll8y5bcast62" /></p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000012884'),
  ('00000000-0000-7000-0000-000278757095', '[Chỉ giao Miền Bắc/Nam 24G411A-B.ATV - Màn hình chơi game IPS FHD LG UltraGear G4 24 inch 144Hz (ép xung) - Hàng chính hãng', 2687300, 0, '<p>THÔNG TIN SẢN PHẨM:</p><p>Tính năng chính</p><p>- Màn hình IPS FHD 24 inch (1920x1080)</p><p>- Tần số quét 120Hz (O/C 144Hz) / 1ms MBR</p><p>- NVIDIA G-SYNC Compatible / AMD FreeSync Premium Pro</p><p> </p><p>- Màn hình của LG hỗ trợ HDR10 và cung cấp độ phủ sRGB 99%, mang lại phổ màu rộng giúp hiển thị màu sắc có độ trung thực cao với màn hình IPS cho trải nghiệm chơi game chân thực.</p><p>- Hình ảnh được mô phỏng để có thể hiểu tính năng rõ hơn và khác biệt so với trải nghiệm sử dụng thực tế.</p><p>- Sản phẩm này hỗ trợ tần số quét 120Hz và lên đến 144Hz ở chế độ ép xung khi kết nối qua DisplayPort 1.4. (HDMI 2.0 hỗ trợ lên đến 144Hz.)</p><p>- Tần số quét và thời gian phản hồi có thể thay đổi tùy thuộc vào môi trường, chẳng hạn như nội dung hoặc hiệu suất PC (CPU/GPU). Cần có card đồ họa và cáp tương thích DP 1.4 (card đồ họa được bán riêng).</p><p>- Hình ảnh được mô phỏng để có thể hiểu tính năng rõ hơn và có thể khác biệt so với trải nghiệm sử dụng thực tế.</p><p>- Giảm mờ chuyển động 1ms làm giảm độ sáng và khi được bật, người dùng không thể sử dụng các tính năng sau: AMD FreeSync Premium / DAS (Dynamic Action Sync)</p><p>- Hiện tượng nháy hình có thể xảy ra khi 1ms MBR hoạt động.</p><p>- Được trang bị công nghệ AMD FreeSync, khả năng tương thích G-SYNC được NVIDIA xác thực, màn hình này đảm bảo không có hiện tượng xé hình, mượt và độ trễ thấp.</p><p>- Bạn có thể dễ dàng chia toàn bộ màn hình thành 6 phần, thay đổi thiết kế chủ đề hoặc thậm chí khởi chạy nền tảng cuộc gọi video bằng phím tắt được ánh xạ. Sản phẩm cũng hỗ trợ các chế độ PBP và PIP để đa nhiệm hiệu quả trên nhiều nguồn đầu vào.</p><p>- Về thiết kế: Người dùng trải nghiệm màn hình rộng hơn và ít bị phân tâm hơn với đường viền siêu mỏng và đế chân đỡ mảnh nhất có thể cùng thiết kế hầu như không có viền. Chân đỡ gần như lơ lửng giúp tăng thêm vẻ đẹp ngăn nắp, nhẹ nhàng, trong khi cảm giác màn hình liền mạch mang lại trải nghiệm hình ảnh chân thực—lý tưởng cho bố cục kép hoặc không gian làm việc tối giản.</p><p>- Độ nghiêng (-5~20°), Có thể treo tường (100x100).</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000012884'),
  ('00000000-0000-7000-0000-000278757325', '[Chỉ giao Miền Bắc/Nam] Laptop LG gram Book 15 inch, IntelCore  i5, hệ điều hành Windows 11 Home , RAM 16GB SSD 512 - Hàng chính hãng', 14883840, 0, '<p>Tính năng chính</p><p>15.6" FHD (1920x1080), chống lóa, tấm nền IPS</p><p>Trợ lý AI Copilot Windows 11</p><p>Bộ xử lý Intel Core i5 / RAM DDR4x / SSD NVMe kép</p><p>-Thúc đẩy tiềm năng của bạn</p><p>Khởi động nhanh với LG gram Book. Chạy trên nền bộ xử lý mạnh và tốc độ tùy chỉnh, LG gram Book luôn đồng hành cùng bạn trên mỗi bước hành trình.</p><p>-Kết hợp giữa phong cách và hiệu suất</p><p>Gram book có thiết kế cứng cáp mà sang trọng, nổi bật ở mọi không gian. Thiết kế góc bo tròn, thanh lịch tạo nên hình bóng mang tính biểu tượng, đồng thời chất liệu kim loại Bạc Titan tô đậm cá tính.</p><p>-Bảo mật nhanh chóng</p><p>Bạn có thể mở và đóng màn trập webcam bất cứ khi nào bạn muốn duy trì bảo mật.</p><p>-Dung lượng lưu trữ có thể nâng cấp</p><p>Được trang bị khe M.2 cho thẻ nhớ SSD có thể nâng cấp, gram book thích ứng với nhu cầu ngày càng tăng của người dùng về lưu trữ để nâng cấp dễ dàng.</p><p>-Bộ xử lý Intel Core dựa trên AI</p><p>Với bộ xử lý Intel Core dựa trên AI, LG gram khai phá sức mạnh của AI, cho phép xử lý bằng AI theo thời gian thực để đáp ứng nhu cầu đa dạng của người dùng.</p><p>-Khám phá sức mạnh của AI</p><p>Khám phá sức mạnh của AI với Copilot trên Windows</p><p>Với Copilot trên Windows, bạn có thể nhận được câu trả lời thực, được truyền cảm ứng và các giải pháp cho vấn đề hoặc dự án của bạn, cũng như tạo ra các hình ảnh từ những ý tưởng.</p><p>Nhấp vào phím Copilot trên bàn phím để truy cập các công cụ thông minh trên gram.</p><p>-Kích hoạt nhanh Copilot</p><p>Bạn có thể khởi động tích hợp Copilot trên thanh tác vụ hoặc nhấn đồng thời phím Windows + C. Ngoài ra, bạn có thể sử dụng phím tắt trên bàn phím để truy cập nhanh vào các công cụ thông minh trên gram.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000008095'),
  ('00000000-0000-7000-0000-000278757381', 'Tháp giặt sấy LG giặt 14kg sấy 10 kg WT1410NHB - Hàng Chính Hãng - Mới 100%', 41334000, 0, '<p><strong>Thiết kế sản phẩm</strong></p><p>- Thiết kế hiện đại, đường nét tinh tế, tông màu đen thanh lịch. Sản phẩm có dạng tủ đứng cho bạn lắp đặt gọn gàng ở nhiều góc trong nhà.</p><p>- Sử dụng gam màu đen sang trọng tăng thêm độ tinh tế cho không gian sống của bạn</p><p> </p><p><img src="" alt="" /></p><p> </p><h3><strong>Bộ điều khiển trung tâm</strong></h3><p><strong>- </strong>Bảng điều khiển cảm ứng chỉ dẫn song ngữ Anh - Việt thân thiện, đi kèm màn hình hiển thị rõ ràng các thông số cho bạn tùy chỉnh các chương trình linh hoạt, chuẩn xác</p><p>- Thay vì 2 bảng điều khiển riêng biệt cho máy sấy và máy giặt, tháp giặt LG WT1410NHB được trang bị Bộ điều khiển trung tâm (Central Control Panel), bảng điều khiển tất cả trong một lần đầu xuất hiện, đem tới sự tiện lợi cho người sử dụng.</p><p> </p><h3><strong>Công nghệ giặt tiên tiến</strong></h3><p><strong>- </strong>AI DD - Giặt thông minh: Tối ưu hóa chuyển động giặt qua cảm biến tự động xác định chất liệu áo quần, bảo vệ sợi vải tốt hơn 18%. Quần áo bền màu và không sờn chỉ.</p><p>- Smart Paring: Chỉ cần nhấn Bắt đầu, tự động nhận biết đối ứng chu trình giặt và sấy quần áo, quần áo đã giặt sẽ được sấy khô ở chu trình tối ưu.</p><p>- TurboWash360˚: Giặt sạch hoàn toàn chỉ trong vòng 39 phút mà vẫn bảo vệ tốt sợi vải.</p><p>- Công nghệ giặt hơi nước Steam+ &amp; chống nhăn Wrinkle Care: Sử dụng hơi nước đun sôi ở nhiệt độ cao, giúp bạn xử lý mọi vết bẩn, diệt khuẩn và khử mùi trên quần áo tốt hơn. Đặc biệt, hơi nước thẩm thấu sâu vào từng sợi vải, giúp giảm nhăn hiệu quả hơn tới 30% và cực thân thiện với làn da.</p><p>- Chu trình chăm sóc dị ứng: Loại bỏ tới 99.9% mạt bụi gia đình, một trong những tác nhân gây dị ứng.</p><p> </p><p><img src="" alt="" /></p><p> </p><h3><strong>Khối lượng giặt và chương trình</strong></h3><p> - Khối lượng giặt tối đa 14kg, sấy 10 kg lựa chọn thích hợp với các hộ gia đình trên 7 người hoặc gia đình ít người hơn nhưng có nhu cầu giặt giũ hằng ngày lớn. </p><p>- Trang bị<strong> </strong>6 chương trình giặt cài đặt sẵn bao gồm: vải bông, vỏ chăn, đồ tinh xảo, đồ hỗn hợp, sấy nhanh, chu trình tải về. Trong đó, có chương trình sấy nhanh giúp tiết kiệm thời gian sấy, đảm bảo khi bạn cần bộ đồ yêu thích đã sẵn sàng để bạn mặc lên người đi chơi, đi dự tiệc, du lịch,...</p><p>- Ngoài ra còn có 6 chương trình sấy tự động là vải bông, vỏ chăn, đồ tinh xảo, đồ hỗn hợp, sấy nhanh, chu trình tải về cho bạn tùy chọn theo nhu cầu sử dụng của mình.</p><p> </p><h3><strong>Động cơ - Công nghệ tiết kiệm điện</strong></h3><p>- Máy giặt LG WT1410NHB.APBPPVN này sử dụng động cơ truyền động trực tiếp cho thiết bị vận hành êm ái, mượt mà, hạn chế tiếng ồn, rung lắc trong quá trình hoạt động. </p><p>- Công nghệ Inverter điều khiển động cơ bằng vi xử lý tinh chỉnh vòng quay động cơ dựa theo điều kiện để đưa vào lồng giặt những hoạt động thích hợp nhằm làm tăng hiệu suất giặt, giảm thiểu chi phí tiền điện, nước mỗi tháng cho gia đình.</p><p>- Nhãn năng lượng: 5 sao. Hiệu suất sử dụng điện 18.6 Wh/kg.</p><p> </p><p><img src="" alt="" /></p><p> </p><p><strong>Tiện ích của sản phẩm</strong></p><p><strong>- </strong>Hẹn giờ giặt: Cài đặt thời gian giặt quần áo linh hoạt, nhờ đó thuận tiện cho việc sắp xếp các công việc nội trợ hoặc cá nhân của bạn.</p><p><strong>- </strong>Khóa trẻ em:<strong> </strong>Tránh trẻ nhỏ nghịch phá hoặc mở cửa máy giặt khi thiết bị đang hoạt động, đảm bảo máy được vận hành hiệu quả và giúp người lớn an tâm hơn khi trong nhà có trẻ nhỏ hiếu động.</p><p>- Điều khiển từ xa bằng điện thoại qua ứng dụng LG ThinQ: dễ dàng phối ghép máy giặt với thiết bị di động qua LG ThinQ, lựa chọn chương trình hoạt động, tùy thích từ xa mọi lúc mọi nơi.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000003862'),
  ('00000000-0000-7000-0000-000278757481', 'Màn hình Philips 22E1N1100/71 21.5 inch Full HD 120Hz – IPS, LowBlue, MPRT 1ms - GiaPhucStore | Hàng Chính Hãng', 1990000, 0, '<h2> <strong>Tính năng nổi bật</strong></h2><ul><li><p><strong>Hiển thị sắc nét, màu chuẩn xác</strong>: Độ phân giải Full HD cùng tấm nền IPS cho hình ảnh trung thực và ổn định dù nhìn ở bất kỳ góc nào.</p></li><li><p><strong>Chuyển động mượt mà</strong>: Tần số quét 100Hz, có thể ép xung lên 120Hz giúp hiển thị mượt hơn khi xem video hoặc chơi game.</p></li><li><p><strong>Phản hồi nhanh 1ms (MPRT)</strong>: Giảm hiện tượng bóng mờ, đặc biệt khi xem phim hành động hoặc game tốc độ cao.</p></li><li><p><strong>Bảo vệ mắt tối đa</strong>: LowBlue Mode lọc ánh sáng xanh và công nghệ Flicker-Free giảm nhấp nháy màn hình.</p></li><li><p><strong>Thiết kế tinh gọn</strong>: Viền mỏng, trọng lượng nhẹ, dễ bố trí và phù hợp cho mọi không gian làm việc.</p></li><li><p><strong>Tiết kiệm năng lượng</strong>: Chỉ tiêu thụ khoảng 14.5W khi hoạt động, thân thiện môi trường.</p></li><li><p><strong>Hỗ trợ VESA 100×100 mm</strong>: Dễ dàng treo tường hoặc lắp vào giá đỡ linh hoạt.</p></li></ul><hr /><h2> <strong>Phù hợp với nhu cầu nào</strong></h2><ul><li><p><strong>Văn phòng – học tập:</strong> hiển thị rõ nét, chống mỏi mắt khi làm việc lâu.</p></li><li><p><strong>Giải trí tại nhà:</strong> xem phim, YouTube, Netflix với màu sắc sống động.</p></li><li><p><strong>Chơi game nhẹ:</strong> hỗ trợ 120Hz, 1ms giúp phản hồi nhanh, mượt mà.</p></li><li><p><strong>Thiết kế cơ bản:</strong> đủ cho các nhu cầu chỉnh sửa ảnh, làm nội dung sRGB.</p></li></ul><hr /><h2>️ <strong>Điểm cần lưu ý</strong></h2><ul><li><p>Không có cổng DisplayPort (chỉ HDMI và VGA).</p></li></ul><p><img class="alignnone wp-image-2670 size-full" src="https://salt.tikicdn.com/cache/w750/ts/product/35/54/56/46f24c033e31dcd034053b7b15536f59.png" alt="" width="750" height="228" /></p><ul><li><p>Chân đế chỉ hỗ trợ nghiêng, không điều chỉnh độ cao hoặc xo