  ('00000000-0000-7000-0000-000278757493', 'Hộp mực W1360A 136A CÓ CHIP TECH dùng cho máy in HP M211d M211dw M236dw - Hàng Nhập Khẩu', 319000, 0, '<p>Thông tin cơ bản<br />Mã sản phẩm: 136A (hoặc W1360A W1360X).<br />Loại mực: Laser trắng đen.<br />Dung lượng: Khoảng 1.150 trang với độ phủ 5%.<br />Hộp mực đã gồm chíp<br />Dùng cho máy in: <br />HP LaserJet M211d<br />HP LaserJet M211dw<br />HP LaserJet M236dw<br />HP LaserJet M236sdw<br />Thương hiệu TECH<br />Hộp mực 136A Tech là sản phẩm mực tương thích, không phải mực chính hãng. Tech là tên thương hiệu sản xuất hộp mực và linh kiện máy in tương thích, mang lại giải pháp thay thế với chi phí thấp hơn cho người dùng</p><p><img src="https://salt.tikicdn.com/ts/tmp/49/eb/07/116351d9499b5ae5c5e0d83861715bed.jpg" alt="" width="750" height="750" /></p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000012884'),
  ('00000000-0000-7000-0000-000278757497', 'USB Wifi TP-Link AX1800 High Gain Wireless Archer TX35U Plus - Hàng chính hãng', 589000, 0, '<article class="4ever-article"><ul><li><div>Chuẩn Wi-Fi 6 AX1800 với tốc độ lên tới 1201 Mbps (5GHz) + 574 Mbps (2.4GHz)</div></li><li><div>2 anten độ lợi cao giúp thu tín hiệu xa, ổn định hơn trong môi trường nhiều vật cản</div></li><li><div>Công nghệ MU-MIMO &amp; OFDMA giảm độ trễ, tối ưu khi nhiều thiết bị cùng truy cập</div></li><li><div>Cổng USB 3.0 tốc độ cao đảm bảo truyền dữ liệu mượt mà, tương thích ngược USB 2.0</div></li><li><div>Bảo mật WPA3 tiên tiến giúp kết nối an toàn hơn</div></li><li><div>Thiết kế anten xoay linh hoạt dễ điều chỉnh góc thu sóng tốt nhất</div></li><li><div>Tương thích Windows 10/11, cài đặt dễ dàng qua driver chính hãng</div></li></ul><p> </p><p class="p1">LƯU Ý KHI MUA HÀNG</p><p class="p1">Cảm ơn quý khách đã quan tâm đến sản phẩm bên shop, quý khách vui lòng dành ít thời gian đọc kĩ các thông tin sau:</p><p class="p1">Shop nhận đổi trả trong trường hợp hàng sai mẫu, size, màu do shop gửi. Bên shop chỉ giải quyết khiếu nại khi quý khách có video clip khi mở/nhận hàng.</p><p class="p1">Sản phẩm cần bảo hành khách chịu phí vận chuyển đến shop hoặc trung tâm bảo hành</p><p class="p1">Khách hàng có nhu cầu xuất hóa đơn VAT, vui lòng liên hệ với gian hàng trực tiếp qua tin nhắn khi đơn hàng được giao thành công.</p><p class="p1">Trong một số trường hợp sản phẩm đã được kích hoạt bảo hành tham gia chương trình khuyến mãi có giá tốt nhất cho khách hàng, vì vậy sản phẩm được bảo hành thông qua nhà bán hàng. Vui lòng chat với shop để được hỗ trợ thêm thông tin.</p><p class="p1">Không nhận đổi trả khi sản phẩm bị hư hại do tác động ngoại lực từ người mua như móp, bể, trầy xước, nổ điện, rớt nước, rách tem bảo hành, không đầy đủ phụ kiện và hộp.</p><p class="p1">Vì lượng hàng hoá nhiều shop không nhận đổi trả trong trường hợp khách không thích, không ưng màu, chất liệu; quý khách vui lòng đọc kĩ mô tả và x