  ('00000000-0000-7000-0000-000278795945', 'Cáp USB 2.0 -> Micro USB Unitek 1m (Y-C 434GBK) Hàng chính hãng', 80000, 0, '<p class="QN2lPu">Bảo hành 18 tháng</p><p class="QN2lPu">- Chuyển dữ liệu USB 2.0 với tốc độ 480 Mbps.</p><p class="QN2lPu">- Ngoài ra có thể sạc và truyền dữ liệu cho điện thoại.</p><p class="QN2lPu">- Cáp làm bằng đồng nguyên chất và có lưới bọc chống nhiễu siêu tốt. Cắm vào là chạy và tự nhận dạng thiết bị.</p><p class="QN2lPu">Thông số kỹ thuật</p><p class="QN2lPu">- Chuyển dữ liệu USB 2.0 với tốc độ 480 Mbps.</p><p class="QN2lPu">- Ngoài ra có thể sạc và truyền dữ liệu cho điện thoại.</p><p class="QN2lPu">- Cáp làm bằng đồng nguyên chất và có lưới bọc chống nhiễu siêu tốt. Cắm vào là chạy và tự nhận dạng thiết bị.</p><p class="QN2lPu">Mô tả sản phẩm</p><p class="QN2lPu">Cáp sạc và truyền dữ liệu điện thoại Android Unitek YC 434 GBK dài 1.5mcó tem chống hàng giả 1. Dài 1.5m 2. Đầu in : USB 2.0 mạ vàng chống oxy hóa, độ bền cao, tiếp xúc 5.000 lần, truyền nhanh 3. Đầu out : Micro usb 3. Chất liệu: _ lõi đồng nguyên chất _ Đầu cáp Nhựa _vỏ nhựa PVC cao cấp 4. Màu sắc : đen 5. Hỗ trợ hầu hết các thiết bị dùng cổng micro điện thoại thông minh, máy tính bảng, máy nghe nhạc MP3, máy ảnh hoặc máy PDA được trang bị cổng USB Hỗ trợ sạc nhanh và truyền dữ liệu.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000028670'),
  ('00000000-0000-7000-0000-000278795964', 'Bộ chia hdmi 1 ra 2 4k V170A Unitek - HÀNG CHÍNH HÃNG ', 680000, 0, '<p class="QN2lPu">Bộ chia HDMI Unitek V170A là thiết bị cho phép phân phối tín hiệu HDMI từ một nguồn ra hai màn hình cùng lúc mà vẫn đảm bảo chất lượng hình ảnh và âm thanh. Sản phẩm này lý tưởng cho các ứng dụng như trình chiếu, giảng dạy, họp trực tuyến, giải trí gia đình, hoặc sử dụng trong văn phòng.</p><p class="QN2lPu"> </p><p class="QN2lPu">Ưu điểm nổi bật của bộ chia HDMI 2.0 1 ra 2 Unitek V170A</p><p class="QN2lPu">Chuẩn HDMI 2.0 tiên tiến: Đảm bảo truyền tải tín hiệu với băng thông cao, hỗ trợ độ phân giải lên đến 4K@60Hz, mang lại hình ảnh sắc nét và chi tiết.</p><p class="QN2lPu">Hỗ trợ âm thanh đa dạng: Tích hợp cổng audio 3,5mm, hỗ trợ các định dạng âm thanh PCM, DTS-HD, Dolby TrueHD, tạo trải nghiệm âm thanh sống động.</p><p class="QN2lPu">Vật liệu cao cấp: Vỏ nhôm chắc chắn giúp thiết bị tản nhiệt tốt, tăng tuổi thọ và độ bền cho sản phẩm.</p><p class="QN2lPu">Thiết kế nhỏ gọn: Dễ dàng lắp đặt và di chuyển, phù hợp với nhiều không gian sử dụng khác nhau.</p><p class="QN2lPu">Dễ sử dụng: Không cần cài đặt phần mềm phức tạp, chỉ cần kết nối các thiết bị là hoạt động ngay lập tức.</p><p class="QN2lPu">Tương thích rộng rãi: Hoạt động tốt với nhiều thiết bị hỗ trợ HDMI như TV, máy chiếu, màn hình máy tính, laptop, đầu phát Blu-ray, và các thiết bị chơi game.</p><p class="QN2lPu">Thông số kỹ thuật chính</p><p class="QN2lPu">Mã sản phẩm: V170A</p><p class="QN2lPu">Thương hiệu: Unitek</p><p class="QN2lPu">Chuẩn HDMI: 2.0</p><p class="QN2lPu">Hỗ trợ độ phân giải: Lên đến 4K@60Hz</p><p class="QN2lPu">Cổng kết nối: 1 cổng HDMI vào, 2 cổng HDMI ra, 1 cổng audio 3,5mm</p><p class="QN2lPu">Hỗ trợ âm thanh: PCM, DTS-HD, Dolby TrueHD</p><p class="QN2lPu">Nguồn điện: 5V DC</p><p class="QN2lPu">Kích thước: 67.3 x 59.1 x 18.3mm</p><p class="QN2lPu">Lợi ích khi sử dụng bộ chia HDMI 1 ra 2 Unitek V170A</p><p class="QN2lPu">Nâng cao hiệu quả công việc và giải trí: Trình chiếu đồng thời trên hai màn hình mà không lo bị gián đoạn tín hiệu, giúp tăng hiệu suất làm việc và trải nghiệm giải trí đa phương tiện.</p><p class="QN2lPu">Tiết kiệm chi phí: Giảm nhu cầu đầu tư thêm thiết bị phát tín hiệu, tiết kiệm không gian và chi phí.</p><p class="QN2lPu">Tính tương thích cao: Hoạt động ổn định với hầu hết các thiết bị hỗ trợ HDMI, đảm bảo sự linh hoạt trong việc kết nối và sử dụng.</p><p class="QN2lPu">Hướng dẫn sử dụng</p><p class="QN2lPu">Kết nối nguồn phát HDMI: Sử dụng cáp HDMI để kết nối nguồn phát (như laptop, đầu Blu-ray) với cổng HDMI vào trên bộ chia.</p><p class="QN2lPu">Kết nối các thiết bị hiển thị: Sử dụng hai cáp HDMI để kết nối hai thiết bị hiển thị (TV, màn hình máy tính) với hai cổng HDMI ra trên bộ chia.</p><p class="QN2lPu">Cấp nguồn cho thiết bị: Kết nối bộ chia với nguồn điện thông qua cổng DC 5V.</p><p class="QN2lPu">Điều chỉnh thiết lập: Nếu cần, điều chỉnh thiết lập trên nguồn phát để đảm bảo tín hiệu được phân phối đồng đều đến cả</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000028670'),
