  ('00000000-0000-7000-0000-000278796223', 'Cáp Type C to Micro USB chính hãng Unitek (Y-C 473BK) -  HÀNG CHÍNH HÃNG ', 106000, 0, '<p class="QN2lPu">GIỚI THIỆU MÔ TẢ VỀ SẢN PHẨM</p><p class="QN2lPu">- Chuyển dữ liệu USB 3.1 với tốc độ 10 Gbps.</p><p class="QN2lPu">- Có khả năng cấp nguồn cho nhiều thiết bị di động.</p><p class="QN2lPu">- Laptop cũng có thể sạc thông qua kết nối USB này.</p><p class="QN2lPu">- Ngoài ra có thể sạc, truyền và kết nối dữ liệu cho nhiều thiết bị. Chỉ cần cắm vào là chạy và tự nhận dạng thiết bị.</p><p class="QN2lPu">- Chiều dài dây cáp : 1m</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000028670'),
  ('00000000-0000-7000-0000-000278796431', 'Cáp USB Nối Dài 2.0 (20m) Extension Unitek (Y-279)- Hàng chính hãng', 537000, 0, '<p class="QN2lPu">- Tích hợp IC khuếch đại tín hiệu, chống nhiễu siêu tốt.</p><p class="QN2lPu">- Gần đầu cổng USB 2.0 có rắc cắm cấp nguồn (DC - 5V / 3.5 * 1.35mm) bổ sung trong trường hợp thiếu nguồn</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000008214'),
  ('00000000-0000-7000-0000-000278800520', 'Sạc dành cho Laptop Dell Latitude E7480 hàng nhập khẩu.', 235000, 0, '<ul><li>Tên sạc: Sạc dành cho Laptop Dell Latitude E7480</li><li>Công suất: 65W/90W</li><li>Chuẩn chân cắm: 7.4 mm x 5.0 mm Chân Kim</li><li>Điện áp vào(input): 100V - 240V</li><li>Điện áp ra(output) : 19.5V-3.34A/4.62A</li><li>Tần số làm việc: 50 -60 Hz</li><li>Hàng mới 100%, hoàn toàn tương thích với máy</li></ul><p><img src="https://salt.tikicdn.com/ts/tmp/86/34/f6/363d7c768e9ba2d17ef594927e7b463d.jpg" alt="" width="750" height="611" /></p><h4><strong>-  Sạc dành </strong>cho Laptop chất lượng cao đảm bảo các thông số kỹ thuật mà máy tính xách tay của bạn yêu cầu, cấp nguồn ổn định chuẩn dòng cho laptop của bạn làm việc tốt nhất.</h4><p>-  Đặc biệt Tính năng bảo vệ laptop nếu điện áp không chính xác, đoản mạch hoặc quá nóng.</p><p>-  Bộ sạc của chúng tôi là những sản phẩm chất lượng cao với các thông số đạt chuẩn giúp laptop của bạn hoạt động luôn ổn định dù phải làm việc liên tục trong thời gian dài qua đó sẽ kéo dài tuổi thọ chiếc Laptop.</p><p>-  Đặc biệt sử dụng bộ sạc chất lượng cao sẽ giúp Pin laptop lâu chai hơn. </p><p>-  Lưu ý: Cắm sạc vào nguồn điện khoảng 10 giây rồi mới cắm vào laptop (vì dòng điện đi vào sạc nó sẽ ổn định dòng trước khi đi ra, nếu cắm ngược lại thì sẽ bị sốc điện và dẫn đến chết nguồn laptop)</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000008129'),
  ('00000000-0000-7000-0000-000278800698', 'CÁP TYPE-C -> 4 USB 3.0 + MICRO USB 10W UNITEK H1107A HÀNG CHÍNH HÃNG ', 449000, 0, '<p class="QN2lPu">Bảo hành 18 tháng</p><p class="QN2lPu">Vỏ nhôm siêu mỏng</p><p class="QN2lPu">Cổng sạc Micro USB 12W</p><p class="QN2lPu">USB3.1 Gen1 5Gbps SuperSpeed</p><p class="QN2lPu">4 cổng để mở rộng USB</p><p class="QN2lPu">uHUB P5 + là dòng hub 5/6 cổng USB-C gồm 6 mẫu với vỏ nhôm siêu mỏng chỉ rộng 3,5mm. H1107A cung cấp cho bạn 4 cổng USB để mở rộng cộng với sạc 12W qua ổ cắm Micro USB</p><p class="QN2lPu">Thông số kỹ thuật</p><p class="QN2lPu">Màu: Xám không gian</p><p class="QN2lPu">Vật chất: Vỏ hợp kim nhôm</p><p class="QN2lPu">Đầu vào: USB-C Male</p><p class="QN2lPu">Đầu ra: USB-A x4, Micro USB (để sạc 10W)</p><p class="QN2lPu">Kích thước: 110mm x 34,8mm x 12,3mm</p><p class="QN2lPu">Chiều dài cáp: 20,5cm</p><p class="QN2lPu">OD: 4,2mm</p><p class="QN2lPu">Mô tả sản phẩm</p><p class="QN2lPu">4 cổng USB-A để mở rộng dễ dàng. Với thông số kỹ thuật USB3.1 Gen1, tốc độ truyền dữ liệu lên đến 5Gbps. Tương thích ngược với USB2.0 / 1.1.</p><p class="QN2lPu">Với cổng Micro USB cho đầu vào nguồn điện bên ngoài 10W, cung cấp hiệu suất đáng tin cậy để sử dụng các thiết bị tiêu thụ điện cao hơn, ví dụ: Ổ cứng.</p><p class="QN2lPu">Đầu nối USB-C cho phép bạn kết nối với máy tính, máy tính bảng và điện thoại thông minh được trang bị USB-C để đồng bộ hóa dữ liệu (cổng USB-C trên thiết bị của bạn yêu cầu chức năng truyền dữ liệu).</p><p class="QN2lPu">Sạc nhanh với công nghệ BC1.2, cung cấp nguồn điện lên đến 5V1,5A trên mỗi cổng USB-A.</p><p class="QN2lPu">Cắm và chạy, không cần trình điều khiển.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000028670'),
  ('00000000-0000-7000-0000-000278800705', 'Cáp nối dài USB 10M Unitek Y - 260 có IC khuếch đại HÀNG CHÍNH HÃNG ', 199000, 0, '<p class="QN2lPu">CHUYỂN DỮ LIỆU USB 2.0 VỚI TỐC ĐỘ 480Mbps</p><p class="QN2lPu">SỬ DỤNG KẾT NỐI KẾT NỐI ĐƯỢC NHIỀU THIẾT BỊ</p><p class="QN2lPu">TÍCH HỢP IC KHUẾCH ĐẠI TÍN HIỆU , CHỐNG NHIỄU SIÊU TỐT</p><p class="QN2lPu">SỬ DỤNG NGUỒN TRỰC TIẾP TỪ CỔNG KẾT NỐI USB 2.0</p><p class="QN2lPu">CHIỀU DÀI CÁP 10M</p><p class="QN2lPu"> </p><p class="QN2lPu">Cáp USB 2.0 nối dài 10m (Y-260) Cáp USB 10M Y-260 là chuẩn USB 2.0. Là cáp Active USB mở rộng, đảm bảo chất lượng tín hiệu 10m chạy tốt có thể dùng cho camera HD 1080p hoặc nối đài các thiết bị qua cổng USB mà không bị suy hao tín hiệu . Tốc độ truyền dữ liệu lên đến 480Mbps Hỗ trợ Plug and Play, không cần dùng phần mềm cài đặt . Không cần dùng điện ngoài, sử dụng diện qua cổng usb Cáp usb dài 10m Y-260 chân mạ vàng 2 đầu cho tiếp xúc tốt hơn, Dây bọc chống nhiễu hai đầu và bên trong cáp Cáp USB dài 10M Y-206 có thể đi dây trong tường mà không sợ bị hỏng , đầu cáp rất chắc chắn</p><p class="QN2lPu">Bảo hành 18 tháng</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000008214'),
  ('00000000-0000-7000-0000-000278800711', 'CÁP CHUYỂN TYPE-C RA 3 USB 3.0 + HDMI + TF/SD UNITEK H1107F HÀNG CHÍNH HÃNG ', 704000, 0, '<p class="QN2lPu">Bảo Hành : 12 tháng</p><p class="QN2lPu">Thông số kỹ thuật</p><p class="QN2lPu">CÁP TYPE-C -&gt; 3 USB 3.0 + HDMI + TF/SD UNITEK H1107F</p><p class="QN2lPu"> </p><p class="QN2lPu">Cổng vào : Type-C (5Gbps)</p><p class="QN2lPu"> </p><p class="QN2lPu">Cổng ra : 3 USB 3.0 (5Gbps), HDMI 4K, Thẻ TF/SD</p><p class="QN2lPu"> </p><p class="QN2lPu">Chiều dài dây cáp : 20cm.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000028670'),
  ('00000000-0000-7000-0000-000278800769', 'Hub USB Type C ra 04 cổng USB 3.0 và 01 cổng nguồn Type C 5V-2A Unitek H1117B - HÀNG CHÍNH HÃNG ', 339000, 0, '<p class="QN2lPu">Thông số kỹ thuật</p><p class="QN2lPu">Màu sắc: Đen</p><p class="QN2lPu">Kích thước: 86,8mm x 26mm x 17mm</p><p class="QN2lPu">Vật liệu: Vỏ ABS</p><p class="QN2lPu">Đầu vào: USB-C</p><p class="QN2lPu">Đầu ra: 4 x USB-A (Tối đa 5Gbps) và USB-C 10W 5V2A</p><p class="QN2lPu">Chiều dài cáp của cáp đi kèm là 15cm</p><p class="QN2lPu">Nội dung đóng gói: 1 x HUB , 1 x Hướng dẫn sử dụng</p><p class="QN2lPu">Mô tả sản phẩm</p><p class="QN2lPu">Giải pháp tuyệt vời để mở rộng cổng USB</p><p class="QN2lPu">Truyền dữ liệu USB 3.0 SuperSpeed ​​(5Gbps), tương thích ngược với USB2.0/1.1</p><p class="QN2lPu">Với cổng nguồn tùy chọn (USB-C) lên đến 10W 5V/2A. Bằng cách kết nối với nguồn điện bên ngoài, có thể cung cấp điện cho các thiết bị ngoại vi</p><p class="QN2lPu">Được thiết kế và sản xuất với công nghệ sạc BC1.2</p><p class="QN2lPu">Cắm và chạy, không cần cài đặt trình điều khiển</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000028670'),
  ('00000000-0000-7000-0000-000278800771', 'CÁP TYPE-C -> HDMI 4K + VGA UNITEK V1126A - HÀNG CHÍNH HÃNG ', 595000, 0, '<p class="QN2lPu">Tổng quan về sản phẩm:</p><p class="QN2lPu">4K @ 60Hz UHD HDMI</p><p class="QN2lPu">Full HD VGA</p><p class="QN2lPu">Bộ chuyển đổi màn hình này tương thích với các thiết bị USB-C, cung cấp tín hiệu âm thanh / video siêu HD lên đến 4K 60Hz HDMI và tín hiệu video full HD 1080P VGA thậm chí kết nối với hai màn hình bên ngoài qua MST.</p><p class="QN2lPu">Tính năng sản phẩm:</p><p class="QN2lPu">Hỗ trợ HDMI với Ultra-HD (UHD) 4K @ 60Hz.</p><p class="QN2lPu">Hỗ trợ VGA với Full HD 1080p @ 60Hz.</p><p class="QN2lPu">Hỗ trợ Truyền tải đa luồng (MST), để hiển thị tín hiệu video từ PC của bạn đến hai màn hình khác.</p><p class="QN2lPu">Hệ điều hành Windows có thể bật tính năng Screen Mirroring và Extend trên màn hình bên ngoài.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000028670'),
  ('00000000-0000-7000-0000-000278800828', 'BỘ CHUYỂN USB3.2 TYPE-C RA 4 USB VÀ 1 TYPE C H1117A UNITEK - HÀNG CHÍNH HÃNG ', 330000, 0, '<p class="QN2lPu">Giải pháp tuyệt vời để mở rộng cổng USB.</p><p class="QN2lPu"> </p><p class="QN2lPu">Truyền dữ liệu USB3.0 SuperSpeed ​​(5Gbps), tương thích ngược với USB2.0 / 1.1.</p><p class="QN2lPu"> </p><p class="QN2lPu">Với một cổng nguồn tùy chọn (USB-C) lên đến 10W 5V / 2A. Bằng cách kết nối với nguồn điện bên ngoài, có thể cấp nguồn cho các thiết bị ngoại vi.</p><p class="QN2lPu"> </p><p class="QN2lPu">Được thiết kế và sản xuất với công nghệ sạc BC1.2.</p><p class="QN2lPu"> </p><p class="QN2lPu">Plug and play, không cần cài đặt trình điều khiển phức tạp.</p><p class="QN2lPu"> </p><p class="QN2lPu">MÃ:H1117A</p><p class="QN2lPu"> </p><p class="QN2lPu">HÃNG:UNITEK</p><p class="QN2lPu"> </p><p class="QN2lPu">MÀU:ĐEN</p><p class="QN2lPu"> </p><p class="QN2lPu">CỔNG VÀO :USB A 3.2</p><p class="QN2lPu"> </p><p class="QN2lPu">CỔNG RA : 4 CỔNG USB VÀ 1 CỔNG NGUỒN TYPE C</p><p class="QN2lPu"> </p><p class="QN2lPu">CHIỀU DÀI CÁP: 86,8MM x 26MM x 17MM</p><p class="QN2lPu"> </p><p class="QN2lPu">CHẤT LIỆU: VỎ LÀM BẰNG CHẤT LIỆU ABS</p><p class="QN2lPu"> </p><p class="QN2lPu">ĐẦU VÀO: 10W 5V2A</p><p class="QN2lPu"> </p><p class="QN2lPu">GÓI GỒM: 1 HUB Q4 VÀ 1 HƯỚNG DẪN SỬ DỤNG</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000028670'),
  ('00000000-0000-7000-0000-000278800860', 'Cáp Type-C -> USB (3.0)/HDMI /LAN+Nguồn Unitek (Y9117) hàng chính hãng ', 1350000, 0, '<p class="QN2lPu">Thương hiệu UNITEK</p><p class="QN2lPu">Model Y9117</p><p class="QN2lPu">Tính năng Type-C -&gt; USB (3.0)/HDMI /LAN</p><p class="QN2lPu">Cổng kết nối cổng vào : Type-C (5Gbps) - &gt; cổng ra : USB 3.0 (5Gbps), HDMI (3840x2160), LAN , cổng cấp nguồn Type-C (Female)</p><p class="QN2lPu">Độ dài 15 cm</p><p class="QN2lPu">Kích thước 98mm x 39mm x 16mm</p><p class="QN2lPu">Với đặc tả USB1.1 GEN1, tốc độ truyền dữ liệu lên đến 5Gbps. Tương thích ngược với USB2.0 / USB1.1.</p><p class="QN2lPu">Gigabit Ethernet cung cấp kết nối internet nhanh và ổn định. Hỗ trợ mạng IPv4 / IPv6, Wake-On-LAN, full duplex và quản lý nguồn điện.</p><p class="QN2lPu">Với cổng HDMI1.4, hỗ trợ độ phân giải 4K. Với một cổng nguồn tùy chọn. Bằng cách kết nối với nguồn điện bên ngoài, nó có thể cấp nguồn cho các thiết bị ngoại vi. Plug and play, không cần phải cài đặt trình điều khiển</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000028670'),
  ('00000000-0000-7000-0000-000278801021', 'Đầu nối hdmi Unitek A1013BK hàng chính hãng ', 62000, 0, '<p class="QN2lPu">Thương hiệu: Unitek</p><p class="QN2lPu">Model: A1013BK</p><p class="QN2lPu">Tính năng sản phẩm</p><p class="QN2lPu">Hỗ trợ 4K HDMI - Tương thích với HDMI 2.0, hỗ trợ 4K@60Hz UHD và HDR.</p><p class="QN2lPu">Khả năng tương thích rộng - Hỗ trợ tín hiệu HDMI từ TV Box, TV Stick, Game Console, PC, Laptop đến HDTV, Màn hình, Máy chiếu, v.v.</p><p class="QN2lPu">Đầu nối bền - Đầu nối mạ vàng để đảm bảo hiệu suất ổn định.</p><p class="QN2lPu">Hỗ trợ đường dài – Hỗ trợ phần mở rộng lên đến 20M cho cáp quang (chỉ đầu vào) và phần mở rộng 10M cho cáp 24AWG (đầu vào/đầu ra).</p><p class="QN2lPu">#daunoihdmi</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000028670'),
  ('00000000-0000-7000-0000-000278801023', 'CÁP USB --> RS232 CHÂN ÂM Y-105D UNITEK 2M HÀNG CHÍNH HÃNG', 195000, 0, '<p class="QN2lPu">Thông số kỹ thuật</p><p class="QN2lPu">Model: Y-105D</p><p class="QN2lPu">Xuất xứ: UNITEK</p><p class="QN2lPu">Chuẩn kết nối USB: USB 2.0</p><p class="QN2lPu">Chuẩn kết nối Serial: COM9-DB9-RS232(9 chân âm)</p><p class="QN2lPu">Chipset: PL2032-Taiwan tính tương thích cao</p><p class="QN2lPu">Chiều dài cáp:2M</p><p class="QN2lPu">Tốc độ dữ liệu: 250Kb</p><p class="QN2lPu">Trình điều khiển CD-vui lòng cài đặt.</p><p class="QN2lPu">Cáp usb chuẩn 2.0 tốc độ cao tương thích với usb 1.1</p><p class="QN2lPu">Cáp usb sang com RS232 ra 9 chân âm</p><p class="QN2lPu">Cáp usb sang Com rs232 cổng âm Unitek Y-105D ứng dụng cho : Máy mã vạch, máy móc công nghiệp, thiết bị đo đạc, máy công cụ CNC, PDA, Điều khiển công nghiệp MCU / PLD / FPGA từ cổng USB, các thiết bị ngành y tế...</p><p class="QN2lPu">Tốc độ truyền dữ liệu lên đến 1Mbps</p><p class="QN2lPu">Dây usb to com fmale Unitek Y-105D hỗ trợ cho Windows 7/8/10 (32/64) / Vista (32/64) / XP (32/64) / Server 2008 (32/64) / Server 2003 (32/64). / ME/98/CE (v4.2 trở lên) / Linux (2,4 trở lên) Mac OS 8 và 9.</p><p class="QN2lPu">Mô tả sản phẩm</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000028670'),
