  ('00000000-0000-7000-0000-000278801421', 'ĐẦU ĐỔI USB 3.0 RA TYPE C UNITEK A1034NI  HÀNG CHÍNH HÃNG ', 119000, 0, '<p class="QN2lPu"> </p><p class="QN2lPu">ĐẦU ĐỔI USB 3.0 RA TYPE C UNITEK A1034NI</p><p class="QN2lPu"> </p><p class="QN2lPu">- Thiết kế nhỏ gọn , sang trọng, dễ dàng mang theo.</p><p class="QN2lPu">- Chất liệu kim loại siêu bền, các mặt tiếp xúc bằng thép không rỉ giúp kết nối tốt hơn, ổn dịnh hơn .</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000028670'),
  ('00000000-0000-7000-0000-000278801475', 'HUB USB 3P 3.0 + SD UNITEK + OTG Y-3048A  HÀNG CHÍNH HÃNG ', 407000, 0, '<p class="QN2lPu">HUB USB 3P 3.0 + SD UNITEK + OTG Y-3048A</p><p class="QN2lPu">TÍNH NĂNG SẢN PHẨM:</p><p class="QN2lPu">- Giải pháp tốt nhất cho việc mở rộng cổng USB.</p><p class="QN2lPu">- Kết hợp hoàn hảo với cổng USB3.0 và đầu đọc thẻ SD.</p><p class="QN2lPu">- Với đặc điểm kỹ thuật USB3.0, tốc độ truyền dữ liệu lên đến 5Gbps.</p><p class="QN2lPu">- Tương thích ngược với USB2.0 / 1.1.</p><p class="QN2lPu">- Hỗ trợ SDXC 2TB.</p><p class="QN2lPu">- Hỗ trợ chức năng OTG.</p><p class="QN2lPu">- Chạy bằng bus, không cần lấy điện từ nguon điện bên ngoài.</p><p class="QN2lPu">- Cắm và chạy, không cần cài đặt trình điều khiển.</p><p class="QN2lPu">- Thượng lưu: USB3.0 Type-A Male</p><p class="QN2lPu">- Hạ nguon: 4 x USB3.0 Kiểu A Nữ</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000028670'),
  ('00000000-0000-7000-0000-000278801488', 'RUỘT UNITEK CAT 6 T012A - HÀNG CHÍNH HÃNG ', 65000, 0, '<p class="QN2lPu">RUỘT UNITEK CAT 6 T012A</p><p class="QN2lPu">Ruột mạng âm tường UNITEK Cat 5 T 016A màu trắng, đen , cat 6 T 012A , T 017A màu đen</p><p class="QN2lPu">Nhân mạng, ổ cắm mạng, ruột mạng Modul jack RJ45</p><p class="QN2lPu">Nhãn màu hỗ trợ đấu dây theo cả hai chuẩn T568A và T568-B</p><p class="QN2lPu">Dễ dàng lắp đặt cáp với tùy chọn góc cáp vào là 900 hay 1800 , tích hợp lacing fixture (sắp xếp dây và bấm cùng một lúc 8 sợi) cho việc bấm cáp bằng công cụ bắm SL (P/n 1725150).</p><p class="QN2lPu">Có gài cố định dây, dễ dàng nhấn cáp</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000008215'),
  ('00000000-0000-7000-0000-000278801824', '(Hàng chính hãng)USB Bluetooth Dongle Bluetooth 5.3 – Bộ thu phát BT không dây cho PC, Laptop', 45000, 0, '<p> Tính năng nổi bật:</p><p> Chuẩn Bluetooth 5.3 mới nhất – kết nối nhanh, ổn định, tiết kiệm điện năng.</p><p> Cắm là nhận (Plug &amp; Play) – không cần cài đặt driver với Windows 10 trở lên.</p><p> Phạm vi kết nối lên tới 20 mét (không vật cản).</p><p>️ Tương thích với máy tính bàn, laptop sử dụng hệ điều hành Windows (7/8/10/11).</p><p> Kết nối đa dạng thiết bị: tai nghe Bluetooth, loa, điện thoại, tay cầm chơi game, bàn phím, chuột…<br /> Thông số kỹ thuật:</p><p>Chuẩn Bluetooth: 5.3</p><p>Cổng giao tiếp: USB 2.0/3.0</p><p>Tốc độ truyền tải: lên đến 3 Mbps</p><p>Tương thích hệ điều hành: Windows 7/8/10/11 (Linux/Mac không hỗ trợ)</p><p>Kích thước nhỏ gọn, dễ mang theo</p><p>Bluetooth 5.3 so với 5.0<br />Bluetooth 5.3 cung cấp một số cải tiến so với Bluetooth 5.0, tập trung vào hiệu quả và độ tin cậy trong truyền thông không dây. Những cải tiến chính bao gồm:</p><p>Phân loại kênh: Bluetooth 5.3 tăng cường khả năng kết nối thiết bị bằng cách tránh các kênh bị tắc nghẽn, do đó giảm nhiễu và cải thiện độ tin cậy.</p><p>Xếp hạng kết nối: Tính năng này giúp giảm đáng kể mức tiêu thụ điện năng bằng cách cho phép các thiết bị chuyển sang chế độ ngủ nhanh hơn và thức dậy không chậm trễ, kéo dài tuổi thọ pin cho các thiết bị được kết nối.</p><p>Giao thức thuộc tính được cải tiến (ATT): Bluetooth 5.3 tối ưu hóa quá trình truyền dữ liệu để nâng cao khả năng phản hồi và hiệu quả.</p><p>Các tính năng này góp phần mang lại trải nghiệm Bluetooth mạnh mẽ hơn, tiết kiệm điện năng hơn và thân thiện với người dùng hơn so với Bluetooth 5.0.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000008215'),
  ('00000000-0000-7000-0000-000278801860', 'Ốp lưng cho Samsung Galaxy Z Fold 6 / Z Fold 7 / Z Fold 5 Likgus trong suốt có sạc không dây- Hàng chính hãng', 165000, 0, '<h2>Ốp lưng Galaxy Z Fold 6 / Z Fold 7 / Z Fold 5 trong suốt có sạc không dây</h2><p>Ốp lưng Galaxy Z Fold 6 / Z Fold 7 / Z Fold 5 được làm từ chất liệu PC và TPU mềm ở phần viền, mặt lưng cứng trong suốt không ố vàng theo thời gian, bốn góc dày lên chống sốc tốt, hạn chế va đập <br />Phía lưng có vòng tròn trắng hỗ trợ hít sạc không dây.<br />Các phím bấm khá êm, chất nhựa trong veo khoe toàn bộ lưng máy.</p><p> </p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000008214'),
  ('00000000-0000-7000-0000-000278801866', 'CÁP USB 2.0 -> MICRO USB 5 IN 1 UNITEK (Y-C 4007BK) hàng chính hãng ', 159000, 0, '<p class="QN2lPu">- HÃNG : UNITEK</p><p class="QN2lPu">- CỔNG VÀO : USB 2.0(480Mbps)</p><p class="QN2lPu">- CỔNG RA : MICRO USB</p><p class="QN2lPu">- TỐC ĐỘ TRUYỀN : 480Mbps</p><p class="QN2lPu">- SẢN PHẨM GỒM : 3 SỢI CÁP 20CM VÀ 2 SỢI CÁP 30CM</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000028670'),
  ('00000000-0000-7000-0000-000278801868', 'Cáp HDMI 1.4 2m Unitek (Y-C 138M ) hàng chính hãng ', 99000, 0, '<p class="QN2lPu">Cable HDMI 2m Unitek Y-C138, Cáp HDMI 1.4 hỗ trợ 1080P 3D X-BOX360, Lõi hợp kim đồng, Vỏ cáp làm từ chất liệu siêu bền, chống nhiễu tốt và mềm dẻo, Tốc độ truyền dẫn cao 10.2 Gbps</p><p class="QN2lPu">- Các tính năng nổi bật của chuẩn HDMI 1.4</p><p class="QN2lPu">1. Tính năng truyền dẫn mạng Ethernet</p><p class="QN2lPu">2. Tính năng Audio Return Chanel. Cái này hay lắm nha, âm thanh chạy qua chạy lại 2 chiều trên 1 sơi cáp HDMI : từ TV đến Receiver và ngược lại. Vây là chỉ với 1 sợi cáp HDMI, vừa dùng để dẫn hình ảnh của phim HD từ cổng HDMI Out của Reiciver lên TV, nhưng lúc coi truyền hình cáp HD trên VTC hay K+, nó lại dẫn ngược âm thanh từ TV chạy xuống Reiceiver ra dàn loa Surround 7.1 hoành tráng luôn (mặc dù đang cắm vào ổng HDMI IN của TV)</p><p class="QN2lPu">3. Hỗ trợ độ phân giải khủng trong tương lai là 4K x 2K : 4096 × 2160 !! Chắc thấy luôn sợi lông trên cọng râu con kiến quá.</p><p class="QN2lPu">4. 3D over HDMI: 3D Bluray, không phải 3D "cấp thấp" Side by Side hay Over by Under đâu nhé, mà là 3D "đích thực", tuyệt đẹp.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000028670'),
  ('00000000-0000-7000-0000-000278801919', 'ĐẦU USB NỐI DÀI 3.0 UNITEK (Y-A020)hàng chính hãng ', 81000, 0, '<p class="QN2lPu">- HÃNG : UNITEK</p><p class="QN2lPu">- CHUYỂN ĐỔI: TỪ CỔNG USB 3.0 SANG CỔNG USB 3.0</p><p class="QN2lPu">- CỎNG GIAO TIẾP : 2 USB 3.0 (5Gbps)</p><p class="QN2lPu">- TƯƠNG THÍCH CỔNG: USB 2.0 (480Mbps)</p><p class="QN2lPu">- CHỨC NĂNG VÀ THIẾT KẾ</p><p class="QN2lPu">+ THIẾT KẾ MỘT GÓC 90 ĐỘ</p><p class="QN2lPu">+ DÙNG ĐỂ ĐỌC VÀ TRUYỀN DỮ LIỆU</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000028670'),
  ('00000000-0000-7000-0000-000278801921', 'ĐẦU MẠNG ĐIỆN THOẠI RJ11 UNITEK 100C/1 HỘP HÀNG CHÍNH HÃNG', 128000, 0, '<p class="QN2lPu">ĐẦU MẠNG ĐIỆN THOẠI RJ11 UNITEK 100C/1 HỘP</p><p class="QN2lPu">- 6P2C OT25TP</p><p class="QN2lPu">- 6P4C OT26TP</p><p class="QN2lPu">- HÃNG : UNITEK</p><p class="QN2lPu">- MÀU : TRẮNG TRONG</p><p class="QN2lPu">- CHẤT LIÊU : PC THÂN THIỆN MÔI TRƯỜNG</p><p class="QN2lPu">- ĐẦU : MẠ VÀNG CHỐNG NHIỄU</p><p class="QN2lPu">- CHỨC NĂNG SỬ DỤNG : DỄ CẮM VÀ RÚT RA, CHẮC CHẮN</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000002663'),
  ('00000000-0000-7000-0000-000278801925', 'BỘ CHIA TYPE C RA 3 USB3.0 + 1 CỔNG HDMI V300A UNITEK HÀNG CHÍNH HÃNG', 583000, 0, '<p class="QN2lPu">- HÃNG : UNITEK</p><p class="QN2lPu">- KÍCH THƯỚC SẢN PHẨM : 115MM x 39MM x 13MM</p><p class="QN2lPu">- CỔNG VÀO : 1 CỔNG TYPE-C</p><p class="QN2lPu">- CỔNG RA : 3 CỔNG USB3.0 VÀ 1 CỔNG HDMI</p><p class="QN2lPu">- CHIỀU DÀI CÁP /OD : 15CM / 4.0MM</p><p class="QN2lPu">Tính năng sản phẩm:</p><p class="QN2lPu">- Giải pháp tốt nhất để mở rộng cổng USB 3.0 Type-C.</p><p class="QN2lPu">- Thiết kế siêu mỏng để tiết kiệm không gian và dễ dàng mang theo.</p><p class="QN2lPu">- Tốc độ truyền dữ liệu USB lên đến 5Gbps, tương thích ngược với USB2.0 / 1.1.</p><p class="QN2lPu">- Sử dụng chipset hiệu suất cao, nó cho phép xử lý đồng thời dữ liệu USB và tín hiệu HDMI.</p><p class="QN2lPu">- Cổng HDMI1.4 hỗ trợ đầu ra độ phân giải 4K 30Hz. Cắm và chạy, không cần cài đặt trình điều khiển.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000028670'),
  ('00000000-0000-7000-0000-000278801931', 'Cáp chuyển Mini Displayport to VGA Unitek Y-6336 BK LCDV - hàng chính hãng ', 234000, 0, '<p class="QN2lPu">Cáp Chuyển Đổi Mini Displayport to VGA là bộ sản phẩm chuyển đổi hữu ích cho máy tính của người dùng được trang bị cổng mini Displayport, để có thể đổi chuyển sang tín hiệu VGA, cho ra hình ảnh sắc nét và sống động. Được tích hợp khả năng tương thích được với Intel Thunderbolt, thiết bị chuyện dụng để truyền tải tín hiệu Video.</p><p class="QN2lPu">- Hãng sản xuất : Unitek</p><p class="QN2lPu">- Model : Y-6336WH</p><p class="QN2lPu">- Tính năng : Kết nối và truyền tải tín hiệu từ cổng mini Displayport sang màn hình hiển thị rộng rãi chuẩn VGA</p><p class="QN2lPu">- Tương thích với chuẩn mini DisplayPort 1.1a.</p><p class="QN2lPu">- Hỗ trợ độ phân giải cao lên đến 1080p.</p><p class="QN2lPu">- Tốc độ truyền tải lên đến 5,4Gbps.</p><p class="QN2lPu">- Hỗ trợ VGA 10 bit, tần số hoạt động 162 Mhz.</p><p class="QN2lPu">- Hỗ trợ hoạt động điện áp thấp, Active 400mW, Standby 15 MW.</p><p class="QN2lPu">- Cắm là sử dụng, không cần cấu hình, không cần nguồn ngoài, nguồn cấp trực tiếp từ cổng mini Displayport</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000008214'),
  ('00000000-0000-7000-0000-000278802052', 'Ốp lưng nhám sạc từ tính nam châm cho iPhone 17 Pro Max / 17 Pro hiệu Likgus - Viền TPU đệm khí Chống sốc, Lưng PC Chống ố chống bám vân tay - Hàng chính hãng', 227050, 0, '  <h2>ỐP LƯNG NHÁM MATTEMAG PRO MAGNETIC – DÀNH CHO IPHONE 17 PRO MAX / 17 Pro</h2>   <p><strong>Mờ sang trọng – Sạc Magnetic chuẩn – Bảo vệ toàn diện</strong></p>   <hr />   <h3><strong>Thiết kế cao cấp – Phong cách hiện đại</strong></h3>   <ul>    <li> <p>Phiên bản <strong>MatteMag Pro</strong> mang phong cách <strong>bán trong mờ (semi-translucent frosted)</strong> kết hợp <strong>viền màu cam nổi bật</strong>, tạo điểm nhấn trẻ trung, thời trang.</p> </li>    <li> <p><strong>Bề mặt nhám mịn chống bám vân tay</strong>, giảm trơn trượt, giữ vẻ sạch đẹp suốt quá trình sử dụng.</p> </li>    <li> <p><strong>Cảm giác cầm nắm thân thiện với da</strong>, mềm mịn và thoải mái, không bám mồ hôi.</p> </li>   </ul>   <hr />   <h3><strong>Tích hợp vòng sạc Magnetic N52 siêu mạnh</strong></h3>   <ul>    <li> <p><strong>Tương thích hoàn hảo với sạc không dây Magnetic</strong> – chỉ cần đặt là sạc, không cần tháo ốp.</p> </li>    <li> <p><strong>Nam châm N52 thế hệ mới</strong> cho lực hút mạnh mẽ, căn chỉnh chính xác, <strong>giữ chặt phụ kiện Magnetic</strong> như pin dự phòng, ví gắn lưng hay giá đỡ xe hơi.</p> </li>    <li> <p>Hỗ trợ <strong>sạc nhanh ổn định và an toàn</strong>, tối ưu tốc độ sạc.</p> </li>   </ul>   <hr />   <h3><strong>Tích hợp nút chụp ảnh vật lý độc quyền</strong></h3>   <ul>    <li> <p><strong>Phím bấm chuyên dụng</strong> giúp bạn <strong>chụp ảnh nhanh, lấy nét và zoom dễ dàng</strong>, tạo trải nghiệm như máy ảnh thực thụ.</p> </li>    <li> <p>Các thao tác thông minh:</p>     <ul>      <li> <p><strong>Slide:</strong> Zoom gần – xa.</p> </li>      <li> <p><strong>Light-Press:</strong> Lấy nét.</p> </li>      <li> <p><strong>Click:</strong> Chụp nhanh.</p> </li>     </ul> </li>    <li> <p>Biến chiếc iP của bạn thành <strong>công cụ sáng tạo chuyên nghiệp</strong> trong từng khoảnh khắc.</p> </li>   </ul>   <hr />   <h3>️ <strong>Bảo vệ 360° – An toàn tuyệt đối</strong></h3>   <ul>    <li> <p><strong>Công nghệ chống sốc 4 góc (Corner Airbags)</strong> hấp thụ và phân tán lực va đập hiệu quả.</p> </li>    <li> <p><strong>Viền nâng bảo vệ cụm camera &amp; màn hình</strong>, chống trầy xước khi đặt xuống mặt phẳng.</p> </li>    <li> <p><strong>Chất liệu TPU + PC cao cấp</strong>, đàn hồi tốt, chống ố vàng, duy trì độ trong suốt bền lâu.</p> </li>   </ul>   <hr />   <h3><strong>Nút bấm độc lập – Nhạy, bền, tinh tế</strong></h3>   <ul>    <li> <p>Thiết kế <strong>nút rời cao cấp</strong>, độ phản hồi cực nhạy, nhấn êm tay.</p> </li>    <li> <p><strong>Màu sắc đồng bộ khung viền</strong>, tăng vẻ sang trọng và liền mạch cho tổng thể.</p> </li>    <li> <p><strong>Kín khít chống bụi</strong>, bảo vệ linh kiện bên trong khỏi oxy hóa và hao mòn.</p> </li>   </ul>   <hr />   <h3>️ <strong>TÍNH NĂNG NỔI BẬT</strong></h3>   <p>Tích hợp sạc Magnetic N52 mạnh mẽ<br /> Nút chụp ảnh vật lý chuyên dụng<br /> Mặt lưng nhám chống bám vân tay<br /> Chống sốc toàn diện, bảo vệ 360°<br /> Cảm giác cầm mềm mịn, thân thiện da tay<br /> Viền nâng bảo vệ camera &amp; màn hình<br /> Thiết kế sang trọng – màu sắc nổi bật</p>   <hr />   <h3><strong>TƯƠNG THÍCH:</strong></h3>   <p>Cho iPhone 17 / 17 Air / 17 Pro / <strong>17 Pro Max</strong></p>   <hr />   <p><strong>MatteMag Pro Magnetic Case – Sự lựa chọn của người dùng đẳng cấp</strong>, kết hợp <strong>phong cách hiện đại, bảo vệ hoàn hảo và trải nghiệm công nghệ tiện lợi mỗi ngày.</strong></p>   <p><strong><img alt="" height="750" src="https://salt.tikicdn.com/ts/product/d1/91/9b/354eb4cc4810b1cd834318aafa63befe.jpg" width="750" /></strong></p>   <p><img alt="" height="750" src="https://salt.tikicdn.com/ts/product/0f/cd/77/6701e04ed3321e9069d00cd396efac9a.jpg" title="" width="750" /></p>   <p><img alt="" height="750" src="https://salt.tikicdn.com/ts/product/c6/1a/a1/db19a686e14f39cd4290c3e05812a425.jpg" title="" width="750" /></p>   <p><img alt="" height="750" src="https://salt.tikicdn.com/ts/product/4f/34/83/ab958beadf7722e7efed54ed6a555a3f.jpg" title="" width="750" /></p>   <p><img alt="" height="750" src="https://salt.tikicdn.com/ts/product/a0/a7/c8/5c29f5ff122501f7e2ba9e6f8f9edb70.jpg" title="" width="750" /></p>   <p><img alt="" height="750" src="https://salt.tikicdn.com/ts/product/3a/70/bd/3819302dcb7941baa7a1486182e8b7a9.jpg" title="" width="750" /></p>   <p><img alt="" height="750" src="https://salt.tikicdn.com/ts/product/42/e2/dc/32b955edd7512ba1eb08402ee5856eda.jpg" title="" width="750" /></p>   <p><img alt="" height="750" src="https://salt.tikicdn.com/ts/product/da/8a/b5/e857c9b4e161f10693ebf2b004c4e621.jpg" title="" width="750" /></p>   <p> </p> <p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000008214'),
  ('00000000-0000-7000-0000-000278802255', 'Kính Cường Lực Camera Đính Đá Cho iPhone 17 Pro Max / 17 Pro hiệu URR Autobot Diamond Circle - Hàng chính hãng', 160000, 0, '  <div>    <br /> Thông tin sản phẩm:    <br /> - Thương hiệu : URR Autobot    <br /> - Tên sản phẩm : Diamond Circle    <br /> - Chất liệu : Kim Loại + Kính    <br /> - Công dụng : Dán bảo vệ camera lens , thời trang    <br /> - Trong hộp : Kính cường lực bảo vệ + Tool dán    <br /> Mô tả sản phẩm:    <br /> - Được chế tác từ sự kết hợp hoàn hảo giữa khung kim loại cao cấp và kính cường lực 9H siêu bền. Nhờ vậy, sản phẩm mang lại khả năng chống trầy xước và chịu va đập vượt trội, bảo vệ toàn diện cụm camera. Không chỉ là một phụ kiện bảo vệ, Diamond Circle còn được xem như một món trang sức sang trọng, tôn vinh vẻ đẹp tinh tế của điện thoại.    <br /> - Với độ mỏng chỉ 0.25 mm, URR Autobot Diamond Circle ôm sát trọn vẹn từng đường nét của cụm camera, không làm điện thoại trở nên cồng kềnh hay dày nặng hơn. Độ mỏng này vừa đủ để bảo vệ chống xước hiệu quả, vừa giữ được trải nghiệm cầm nắm nguyên bản, đảm bảo iPhone của bạn vẫn giữ được vẻ ngoài thanh thoát, tinh tế vốn có.    <br /> - Thiết kế 3D hai tầng thông minh giúp ôm khít từng mắt camera, không để khoảng trống rỗng bên trong, nhờ đó khả năng chịu lực được tăng cường gấp nhiều lần so với các loại lens thông thường. Điều này đồng nghĩa với việc camera của bạn sẽ luôn được bảo vệ vững chắc ngay cả khi điện thoại vô tình bị rơi hoặc va chạm mạnh trong quá trình sử dụng.    <br /> - Bề mặt kính cường lực được phủ lớp AR chống nhiễu sáng chuyên dụng, giúp giảm thiểu tối đa hiện tượng lóe sáng, mờ nhòe và nhiễu ảnh khi chụp. Đồng thời, lớp phủ này hỗ trợ lấy nét nhanh, giữ cho mọi bức ảnh và video đều sắc nét, trung thực và sống động.    <br /> - Một trong những yếu tố quan trọng giúp Diamond Circle được yêu thích chính là màu sắc được tinh chỉnh chính xác đến 95% so với màu gốc của iPhone. Nhờ đó, khi dán lên máy, gần như không thể nhận ra sự khác biệt, giúp điện thoại trông như chưa hề gắn thêm phụ kiện nào. Điều này giữ nguyên sự liền mạch, tinh tế và đẳng cấp vốn có của sản phẩm Apple.    <br /> - Đường viền kim loại đính đá Diamond cao cấp. Những viên đá được sắp xếp tỉ mỉ, tạo nên hiệu ứng ánh sáng lấp lánh, khiến cụm camera trở thành điểm nhấn nổi bật và nâng tầm phong cách cho chiếc iPhone.    <br /> - Để tăng độ bền và chống chịu tốt hơn trong mọi điều kiện sử dụng, sản phẩm còn được phủ lớp PVD công nghệ cao. Lớp phủ này giúp bề mặt luôn bóng đẹp, chống trầy xước, hạn chế bong tróc và bay màu.    <br /> - Đạt chuẩn kháng nước IPX6. Điều này đồng nghĩa với việc cụm camera luôn được bảo vệ trước hơi ẩm, nước bắn hay môi trường ẩm ướt.    <br /> - Để tối ưu trải nghiệm của người dùng, bộ sản phẩm đi kèm khung căn chỉnh thông minh. Chỉ cần vệ sinh cụm camera sạch sẽ, đặt khung lên và ấn nhẹ, miếng lens sẽ tự động cố định hoàn hảo, vừa khít mà không cần canh chỉnh nhiều lần.    <br />    <img src="https://salt.tikicdn.com/ts/product/2b/4a/ba/e49dbeee466aea8b30b768a49e7ea262.jpg" alt="e49dbeee466aea8b30b768a49e7ea262.jpg" />  </div> <p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000008214'),
  ('00000000-0000-7000-0000-000278803905', 'Google Tivi Sony 4K 55 inch K-55S20VM2/ 65 inch K-65S20M2/ 75 inch K-75S20M2 - Mẫu Mới 2025 - Hàng Chính Hãng, Mới 100% ', 12962000, 0, '<p>Hình ảnh hiển thị sắc nét, sống động với độ phân giải 4K trên màn hình 55 inch vừa vặn cho không gian vừa.<br />Tăng cường độ chi tiết và độ rõ nhờ công nghệ 4K X-Reality PRO xử lý hình ảnh thông minh.<br />Trải nghiệm xem thể thao mượt mà hơn với Motionflow XR 200 hạn chế nhòe khi chuyển động nhanh.<br />Âm thanh vòm lan tỏa sống động nhờ tích hợp Dolby Atmos và DTS Digital Surround.<br />Thao tác đơn giản, cá nhân hóa nội dung dễ dàng với hệ điều hành Google TV.<br />Ra lệnh nhanh chóng bằng giọng nói tiếng Việt nhờ micro tích hợp trên tivi.</p><div> </div><div><p><img src="https://salt.tikicdn.com/ts/product/8a/95/b0/27350ae95593efa2ed20c0cf531c4692.png" alt="1_grande.png" /></p><p> </p><p>Thông số kỹ thuật</p><p>- Tổng quan sản phẩm<br />Loại Tivi: Google Tivi<br />Kích cỡ màn hình: 55 inch<br />Độ phân giải: 4K (Ultra HD)<br />Loại màn hình: Đèn nền: LED nền (Direct LED), Tấm nền: LCD<br />Hệ điều hành: Google TV<br />Chất liệu chân đế: Nhựa<br />Chất liệu viền tivi: Nhựa<br />Nơi sản xuất: Việt Nam<br />Năm ra mắt: 2025<br />- Công nghệ hình ảnh<br />Công nghệ hình ảnh: HLG, HDR10, Màu sắc sống động Live Color, Kiểm soát đèn nền Frame Dimming, Nâng cấp hình ảnh 4K X-Reality PRO, Tinh năng Game Menu, Chuyển động mượt Motionflow XR 200<br />Bộ xử lý: Bộ xử lý X1 4K Processor<br />Tần số quét thực: 60 Hz<br />- Tiện ích<br />Điều khiển tivi bằng điện thoại: Ứng dụng Google TV, Ứng dụng BRAVIA Connect<br />Điều khiển bằng giọng nói: Google Assistant có tiếng Việt<br />Chiếu hình từ điện thoại lên TV: Chromecast, AirPlay 2<br />Remote thông minh: Remote tích hợp micro tìm kiếm giọng nói (RMF-TX830V)<br />Kết nối ứng dụng các thiết bị trong nhà: Apple HomeKit<br />Ứng dụng phổ biến: YouTube, Netflix, Galaxy Play (Fim&#43;), FPT Play, VieON, Eco, Dashboard<br />Tiện ích thông minh khác: Micro tích hợp trên TV - điều khiển giọng nói rảnh tay<br />- Công nghệ âm thanh<br />Tổng công suất loa: 20W<br />Số lượng loa: 2 loa<br />Âm thanh vòm: Dolby Audio Dolby Atmos, DTS, DTS Digital Surround, Âm thanh vòm S-Force Front Surround<br />Các công nghệ khác: Bộ khuếch đại âm thanh S-Master Digital Amplifier, Tùy chọn âm thanh theo nội dung phát, Tùy chỉnh âm thanh theo môi trường Clear Phase<br />- Cổng kết nối<br />Kết nối Internet: Wi-Fi, Cổng mạng LAN<br />Kết nối không dây: Bluetooth 5.3<br />USB: 2 cổng USB A<br />Cổng nhận hình ảnh, âm thanh: 4 cổng HDMI có 1 cổng HDMI eARC (ARC)<br />Cổng xuất âm thanh: 1 cổng Optical (Digital Audio), 1 cổng eARC (ARC)<br />- Thông tin lắp đặt<br />Kích thước có chân, đặt bàn: Ngang 122.7 cm - Cao 78.2 cm - Dày 28.8 cm<br />Khối lượng có chân: 13.5 kg<br />Kích thước không chân, treo tường: Ngang 122.7 cm - Cao 72.4 cm - Dày 8.2 cm<br />Khối lượng không chân: 13.2 kg<br />Hãng: Sony</p><p><strong>– Sự Lựa Chọn Đỉnh Cao Cho Không Gian Giải Trí Hiện Đại</strong><br />Google Tivi Sony K-55S20M2 55 Inch 4k là sản phẩm đột phá trong phân khúc tivi 4K, mang đến trải nghiệm giải trí sống động, sắc nét và đầy màu sắc. Được trang bị công nghệ hình ảnh tiên tiến cùng các tính năng thông minh, sản phẩm này chính là lựa chọn hàng đầu cho những ai yêu thích công nghệ và mong muốn nâng tầm không gian giải trí tại gia.</p><h2> </h2><p><img src="https://salt.tikicdn.com/cache/w750/ts/product/44/14/1d/7e4dfccbf619e2c6c58a50cbe20b78ba.jpg?v&#61;1745173859207" alt="Google Tivi Sony K-55S20M2 55 Inch 4k" /></p><hr /><h2> </h2><div><p><strong>1. Giới Thiệu Chung</strong><br />Google Tivi Sony K-55S20M2 55 Inch 4k được thiết kế để đáp ứng nhu cầu giải trí của cả gia đình với chất lượng hình ảnh 4K siêu sắc nét và khả năng xử lý mạnh mẽ nhờ công nghệ 4K Processor X1. Hệ điều hành Android 12 tích hợp Google TV mang đến giao diện trực quan, cho phép truy cập dễ dàng tới hàng ngàn ứng dụng, phim ảnh và chương trình truyền hình yêu thích.</p><p>Sản phẩm còn tích hợp trợ lý ảo Google Assistant giúp bạn dễ dàng điều khiển tivi bằng giọng nói, tìm kiếm thông tin và điều chỉnh các cài đặt chỉ với một vài lệnh đơn giản. Ngoài ra, việc hỗ trợ Apple AirPlay 2 và Google Cast giúp bạn dễ dàng chia sẻ nội dung từ các thiết bị di động lên màn hình tivi, đem lại trải nghiệm giải trí liền mạch.</p><p><strong>2. Tính Năng Nổi Bật</strong><br />Công Nghệ Xử Lý Hình Ảnh 4K Processor X1:<br />Mang đến hình ảnh sống động, sắc nét với dải màu phong phú và độ tương phản cao, giúp từng chi tiết trở nên chân thực đến từng milimet.</p></div><p></p><p> </p><p><strong>4K X-Reality PRO:</strong><br />Tự động nâng cấp hình ảnh từ các nguồn không phải 4K, khôi phục lại độ sắc nét và chi tiết cho mọi nội dung xem.</p><p><strong>Motionflow XR:</strong><br />Công nghệ khắc phục hiệu ứng mờ nhòe khi xem các cảnh chuyển động nhanh, đảm bảo hình ảnh luôn mượt mà và rõ ràng trong các trận đấu thể thao hay bộ phim hành động.</p><p><strong>Google TV &amp; Google Assistant:</strong></p><p> </p><p>Giao diện thông minh tích hợp hàng nghìn ứng dụng giải trí, hỗ trợ tìm kiếm bằng giọng nói và cá nhân hóa trải nghiệm theo sở thích của người dùng.</p><p><strong>Hỗ Trợ Apple AirPlay 2 và Google Cast:</strong><br />Cho phép truyền tải nội dung từ điện thoại, máy tính bảng hoặc laptop lên màn hình tivi một cách nhanh chóng và dễ dàng.</p><p><strong>Tính Năng Gaming Đỉnh Cao:</strong><br />Tích hợp chế độ Auto HDR Tone Mapping và Auto Genre Picture Mode tối ưu hóa hình ảnh khi chơi game trên PS5 và các hệ máy chơi game khác, giúp giảm độ trễ và cải thiện trải nghiệm chơi game.</p><p></p><p> </p><p><strong>Eco Dashboard:</strong><br />Cung cấp các cài đặt tiết kiệm năng lượng, giúp người dùng quản lý mức tiêu thụ điện một cách hiệu quả, góp phần bảo vệ môi trường.</p><p><strong>3. Thiết Kế Sang Trọng Và Hiện Đại</strong><br />Google Tivi Sony K-55S20M2 55 Inch 4k sở hữu thiết kế tinh tế với mặt tiền Flush Surface và chân đế Slim T Shape Blade Stand, tạo nên một tổng thể hài hòa và sang trọng. Kiểu dáng hiện đại này không chỉ đem lại trải nghiệm giải trí đỉnh cao mà còn làm nổi bật phong cách nội thất của ngôi nhà bạn.</p><p>Sản phẩm có màu đen trang nhã, dễ dàng kết hợp với nhiều phong cách trang trí khác nhau, từ hiện đại đến cổ điển. Kích thước 55 inch vừa đủ để tạo ra không gian xem phim rộng rãi nhưng vẫn phù hợp với các phòng khách có diện tích trung bình đến lớn.</p><p><strong>4. Công Nghệ Thông Minh Và Trải Nghiệm Giải Trí</strong><br />Với giao diện Google TV thông minh, Google Tivi Sony K-55S20M2 55 Inch 4k cho phép người dùng dễ dàng truy cập hàng nghìn ứng dụng giải trí và nội dung trực tuyến. Bạn có thể lướt qua danh mục phim, chương trình truyền hình, video ca nhạc và thậm chí là trò chơi ngay trên màn hình chính của tivi.</p><p>Tính năng Google Assistant tích hợp giúp người dùng điều khiển tivi bằng giọng nói, tìm kiếm thông tin hoặc thay đổi cài đặt chỉ bằng một lệnh đơn giản. Điều này không chỉ mang lại sự tiện lợi mà còn giúp nâng cao trải nghiệm giải trí tổng thể của gia đình.</p><p><strong>5. Kết Nối Và Âm Thanh Sống Động</strong><br />Google Tivi Sony K-55S20M2 55 Inch 4k được trang bị hệ thống âm thanh cao cấp với công nghệ Dolby Atmos kết hợp cùng DTS, mang đến âm thanh rõ ràng, sống động và bao phủ không gian. Công nghệ Clear Phase đảm bảo hiệu ứng âm thanh được phân bổ đồng đều, giúp người xem cảm nhận được từng chi tiết nhỏ của âm thanh từ các cảnh phim hành động hay buổi hòa nhạc trực tiếp.</p><p>Các cổng kết nối hiện đại như HDMI, USB và Ethernet giúp bạn dễ dàng kết nối với các thiết bị ngoại vi như máy chơi game, đầu đĩa Blu-ray hay máy tính, mở rộng khả năng sử dụng của tivi trong mọi tình huống.</p><p><strong>6. Tối Ưu Cho Giải Trí Và Chế Độ Gaming</strong><br />Sản phẩm được thiết kế đặc biệt cho những tín đồ game với các chế độ hình ảnh tối ưu như Auto HDR Tone Mapping và Auto Genre Picture Mode. Nhờ đó, dù là chơi game trên hệ máy PS5 hay xem các nội dung thể thao, bạn vẫn có thể tận hưởng hình ảnh mượt mà, rõ nét với độ trễ thấp. Chế độ Gaming được tích hợp sẵn sẽ tự động điều chỉnh các thiết lập phù hợp với từng loại nội dung, mang đến trải nghiệm chơi game cực đỉnh.</p><p><strong>7. Kết Luận</strong><br />Google Tivi Sony K-55S20M2 55 Inch 4k là sản phẩm toàn diện, kết hợp những công nghệ tiên tiến về hình ảnh, âm thanh và giao diện thông minh, mang lại trải nghiệm giải trí đỉnh cao cho người dùng. Với thiết kế hiện đại, chất lượng hình ảnh vượt trội và các tính năng tối ưu cho gaming, sản phẩm này không chỉ là lựa chọn lý tưởng cho gia đình mà còn là biểu tượng của công nghệ giải trí hiện đại trong năm 2025.</p><p>Nếu bạn đang tìm kiếm một chiếc tivi có khả năng biến không gian phòng khách thành rạp chiếu phim tại gia, Google Tivi Sony K-55S20M2 55 Inch 4k chính là sự lựa chọn hoàn hảo, đáp ứng mọi nhu cầu giải trí của bạn một cách trọn vẹn và đầy ấn tượng.<br /> </p></div><p> </p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000005015'),
  ('00000000-0000-7000-0000-000278806873', 'USB Lexar Jumpdrive V400 USB 3.0 (LJDV400032G-BNBNG) - Hàng Chính Hãng', 139000, 0, '<p><strong>USB Lexar JumpDrive V400</strong> cung cấp cho bạn không gian lưu trữ di động đáng tin cậy, cho phép bạn dễ dàng di chuyển, lưu trữ và chia sẻ tập tin. USB được thiết kế với lỗ khóa móc tiện lợi, giúp bạn dễ dàng gắn vào vòng khóa, ba lô, hoặc bất cứ đâu thuận tiện.</p><p> <img src="https://salt.tikicdn.com/cache/w750/ts/product/b4/44/17/f08b809ec9d32d78ebb5a01ce3ac9b51.jpg" alt="" width="750" height="750" /></p><p><strong>USB Lexar JumpDrive V400</strong> có thiết kế plug-and-play đơn giản cho phép bạn lưu trữ các tập tin một cách nhanh chóng và vô cùng dễ dàng.</p><p><img src="https://salt.tikicdn.com/ts/product/24/c0/b6/3c4fb51f0328c89a4a45b693cad37111.jpg" alt="" width="700" height="700" /></p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000008060'),
  ('00000000-0000-7000-0000-000009847206', 'Máy chấm công mặt, vân tay, thẻ ZKTeco MB20ID', 2990000, 0, '<p><span style="color: #696969; font-family: Roboto, sans-serif;">Máy chấm công khuôn mặt, vân tay và thẻ ZKTeco MB20ID là sản phẩm đa năng tập hợp tất cả các phương thức nhận dạng phổ biến như nhận dạng khuôn mặt, nhận dạng vân tay, thẻ từ và mật mã. Dòng sản phẩm với dung lượng trung bình phù hợp với mục đích sử dụng trong văn phòng, nhà riêng, nhà xưởng quy mô nhỏ…</span><br style="color: #696969; font-family: Roboto, sans-serif;" /><span style="color: #696969; font-family: Roboto, sans-serif;">1.Phương thức nhận dạng: Khuôn mặt, vân tay, mật mã và thẻ</span><br style="color: #696969; font-family: Roboto, sans-serif;" /><span style="color: #696969; font-family: Roboto, sans-serif;">2.Dung lượng: 200 Khuôn mặt, 500 Vân tay, 1000 thẻ, 1000 người sử dụng. Bộ nhớ giao dịch 50.000 lần</span><br style="color: #696969; font-family: Roboto, sans-serif;" /><span style="color: #696969; font-family: Roboto, sans-serif;">3.Phương thức kết nối: Cổng USB và mạng lan TCP/IP</span><br style="color: #696969; font-family: Roboto, sans-serif;" /><span style="color: #696969; font-family: Roboto, sans-serif;">4.Màn hình màu LCD 2,8 inch</span><br style="color: #696969; font-family: Roboto, sans-serif;" /><span style="color: #696969; font-family: Roboto, sans-serif;">5.Nhiệt độ hoạt động: 0-45 độ .</span></p><p><span style="color: #696969; font-family: Roboto, sans-serif;">6.Độ ẩm hoạt động: 20%- 80%</span></p><p><span style="color: #696969; font-family: Roboto, sans-serif;">7.Nguồn DV5V 0.8A</span><br style="color: #696969; font-family: Roboto, sans-serif;" /><span style="color: #696969; font-family: Roboto, sans-serif;">8.Kích thước: 161.9 x 152.8 x 30.6 (R x C x S)</span></p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '00000000-0000-7000-0000-000000012884')
